INSERT INTO `pokemonsets` VALUES (1,'Metal BigMon',115,NULL,252,NULL,NULL,NULL,252,714,16,113,252,216,389,280,'Brick Break para romper pantallas, lastimar severamente a otros kangas (y rematarlos con sucker), tener daño neutro para mawile (daño decente) y eliminar T-Tar de 1 golpe',NULL,'2014-11-13 22:23:53','2015-11-27 03:45:18',5,1,3,2,1,5,0,NULL,1),(2,'Neme\'s Gyara',130,204,NULL,8,NULL,84,212,211,16,22,182,444,127,269,'Gyarados es un excelente counter para Talonflame, Charizard-Y y Aegislash y este set busca sacarle partido a esas ventajas. En primer lugar analizaremos nuestras ventajas contra Talonflame. Tenemos Intimadate, el cual nos perimitira resistir varias arremetidas de Brave Bird mientras nosotros contratacamos con Waterfall o Stone Edge. Para Charizard-Y si es necesario recurrir a Stone Edge dado que el sol nos bajara el poder de Waterfall. Es por esa razón que este set esta diseñado para resistir 3 Solarbeam de Charizard-Y dándonos tiempo de sobra para poder atinar ese maldito Stone Edge (porque créanme que falle demasiado). De la misma forma que la anterior y como se podrán haber dado cuenta este set es muy defensivo y por ende, resiste varios ataques de Aegislash Modest, ya que somos resistentes a los movimientos tipo acero (Steel), el único movimiento que podemos esperar de la espada es Shadow Ball y con este set resistimos tres de ellas, tiempo suficiente para poder hacer un Taunt y evitar así que la espada tome su forma defensiva o entre en Sub y finalmente lo rematamos con Waterfall cuando se encuentra en Blade-Form. Por ultimo, pero no menos importante, es la razón de que nuestro Gyarados sea Jolly, y la única razón para buscar velocidad en este set es para ser un punto más rápido que Smeargle y poder tauntearlo y evitar un Dark Void. ',0,'2014-11-13 22:23:53','2015-11-26 01:58:01',12,4,8,4,4,12,0,NULL,1),(4,'Standard Garchomp',445,4,252,NULL,NULL,NULL,252,134,16,24,337,89,157,182,'El Garchomp estandar, sirve para casi todo tipo de equipos',NULL,'2014-11-13 22:23:53','2015-11-27 03:46:25',2,0,1,1,0,2,0,1,1),(5,'Modest Mega Manectric',310,92,NULL,24,252,NULL,140,721,3,31,85,237,555,182,'IV Spread: 31-30-30-31-31-31 Hidden Power Ice\r\nModest para tener un 89% de probabilidad de derrotar a Garchomp de un golpe\r\nSnarl para los Aegislash con Substitute\r\nVelocidad suficiente para ganarle a Speed Base 105 para abajo',NULL,'2014-11-13 22:23:53','2014-11-13 22:23:53',0,0,0,0,0,0,0,1,1),(6,'Mixed Aegislash',681,252,4,NULL,252,NULL,NULL,211,23,176,533,588,247,164,'Sacred Sword para pegarle super efectivo a Tyranitar, Bisharp y Mega Kangaskhan',NULL,'2014-11-13 22:23:53','2015-11-27 03:44:09',4,2,3,1,2,4,0,1,1),(7,'Cano\'s Staraptor',398,212,252,NULL,NULL,NULL,44,264,16,22,413,370,369,515,'Evs en Hp suficientes para derrotar a Garchomp con Final Gambit, Velocidad suficiente para ganarle a Timid Mega Manectric, el resto de EVs en Ataque para pegar fuerte con Brave Bird',NULL,'2014-11-13 22:23:53','2015-11-26 01:58:04',6,4,5,1,4,6,0,1,1),(8,'Banded Staraptor',398,4,252,NULL,NULL,NULL,252,197,16,120,413,38,370,98,'\r\n252 Atk Choice Band Reckless Staraptor Double-Edge vs. 252 HP / 44 Def Rotom-H: 157-186 (100 – 118.4%) — guaranteed OHKO\r\n252 Atk Choice Band Staraptor Close Combat vs. 4 HP / 0 Def Mega Kangaskhan: 194-230 (107.1 – 127%) — guaranteed OHKO\r\n252 Atk Choice Band Reckless Staraptor Brave Bird vs. 220 HP / 44 Def Mega Charizard Y: 202-238 (111.6 – 131.4%) — guaranteed OHKO\r\n252 Atk Choice Band Reckless Staraptor Brave Bird vs. 4 HP / 0 Def Garchomp: 180-213 (98.3 – 116.3%) — 93.8% chance to OHKO',0,'2014-11-13 22:23:53','2015-11-27 03:44:13',4,2,3,1,2,4,0,1,1),(9,'Standard Mega Ttar',248,4,252,NULL,NULL,NULL,252,708,11,45,349,157,242,182,'Despues de un DD es capaz de superar en velocidad a los Speed Base 115 para abajo',NULL,'2014-11-13 22:23:53','2015-08-26 17:51:21',2,0,1,1,0,2,0,1,1),(10,'Ray Rizzo\'s Mawile',303,252,52,4,NULL,180,20,720,14,22,583,442,389,182,'Timid 252 SpAtk Choice Specs Salamen