tizar sobrevivir un Shadow Ball de Aegislash Special y solo nos vencerá de un OHKO un Dark Pulse de Hydreigon Specs.',0,'2014-11-13 22:23:53','2015-03-18 13:44:12',1,-1,0,1,-1,1,0,5,1),(17,'Scrafty de apoyo',560,252,252,NULL,NULL,4,NULL,134,11,22,252,409,242,269,'',NULL,'2014-11-13 22:23:53','2015-11-27 03:46:29',2,0,1,1,0,2,0,1,1),(18,'Special Offensive Rotom-H',723,252,NULL,NULL,252,NULL,NULL,135,3,26,182,315,85,261,'',NULL,'2014-11-13 22:23:53','2015-03-18 13:39:10',1,-1,0,1,-1,1,0,5,1),(19,'Standard Mega Char-Y ',6,4,NULL,NULL,252,NULL,252,717,3,66,182,257,76,315,'',NULL,'2014-11-13 22:23:53','2015-03-18 13:39:18',2,-2,0,2,-2,2,0,5,1),(20,'Choice Band Talon',663,4,252,NULL,NULL,NULL,252,197,11,177,369,413,394,261,'',NULL,'2014-11-13 22:23:53','2015-03-18 13:39:28',1,-1,0,1,-1,1,0,5,1),(21,'Offensive Mamoswine',473,4,252,NULL,NULL,NULL,252,247,11,47,182,420,157,89,'',NULL,'2014-11-13 22:23:53','2015-04-04 15:29:38',1,1,1,0,1,1,0,5,1),(22,'Special Wall Amoonguss',591,252,NULL,100,NULL,156,NULL,583,4,144,182,476,147,202,'',NULL,'2014-11-13 22:23:53','2015-03-18 13:39:52',2,2,2,0,2,2,0,5,1),(23,'Se Jun Park\'s Talonflame (possible)',663,NULL,246,NULL,12,NULL,252,247,20,177,413,315,269,501,'Permite darle OHKO a Mega Mawile 252hp/4spdef',NULL,'2014-11-13 22:23:53','2015-03-18 13:40:00',1,-1,0,1,-1,1,0,1,1),(24,'Bulky Super-size Gourgeist',711,252,NULL,36,NULL,220,NULL,211,12,119,566,73,261,182,'Los Evs estan dados para aguantar un Brave Bird Life Orb 252+ de Talonflame\r\n\r\nLa idea es eliminar los threats directos de Gourgeist para sacarlo en el late-game.\r\nGracias a su bulk y el recovery de Leech seed + leftovers, tiene casi asegurada la victoria contra oponentes que no le dan OHKO\r\n\r\nEn general la estrategia es leech seed, luego Will-o-Wisp, y finalmente alternar entre Protect y Phantom Force para maximizar el recovery',0,'2014-11-13 22:23:53','2015-03-18 13:40:15',2,2,2,0,2,2,0,1,1),(25,'Support Raichu',26,4,NULL,NULL,252,NULL,252,252,5,31,521,252,227,237,'