L,252,4,NULL,135,23,114,330,414,58,182,'',NULL,'2014-11-14 15:17:07','2014-11-14 15:17:07',0,0,0,0,0,0,0,3,1),(38,'Vileplume All out Attacker',45,36,NULL,220,252,NULL,NULL,683,3,27,605,202,237,188,'Vileplume es un Pokémon que con el apogeo de Mega-Venusaur suele no tener cabida en casi ningún equipo actual pero tiene cualidades ofensivas bastante interesantes. El desconocimiento de alguno de los ataques que puede aprender más la ventaja de que usualmente se le puede considerar un Pokémon defensivo lo hacen una real alternativa para sorprender a tu oponente.\r\n\r\nDe modo muy suscinto, Vileplume es capaz de aprender dazzling gleam/brillo mágico ; ataque que aún sin poseer bonificación STAB nos permite una interesante cobertura contra Pokémon bastante comunes como Garchomp e Hydreigon. A éste último con un 18.8% de 1OKHO y con un 31,2% de soportar fire blast/llamarada de Hydreigon modest specs (sin contar que soporta el 100% de las veces su draco meteor). También es capaz de soportar un return/retribución de jolly Mega-Kangaskhan y provocar un daño cercano al 50% con sludge bomb/bomba lodo. Azumarrill y en general cualquier hada no inmune al veneno caerá ante nuestro querido Vileplume. \r\n\r\nPS: Hidden power ice es interesante para cobertura extra, aunque queda a elección del jugador.',NULL,'2014-11-15 00:06:53','2014-11-15 00:58:57',1,-1,0,1,-1,1,0,7,1),(39,'Venu Pledge',3,252,NULL,128,128,NULL,NULL,683,3,34,520,76,188,237,'Usa Hidden Power Rock',0,'2014-11-15 00:09:27','2014-11-16 23:21:55',3,-1,1,2,-1,3,0,8,1),(40,'Umbre-On',197,252,NULL,152,NULL,100,NULL,211,2,39,270,269,555,182,'Set Suporter de Umbreon,un Pokemon que bien jugado puede dar un exelente suport a un compañero para lograr un KO importante con Helpinh Hand,llega a ser mas rapido que Gothitelle para llegar a tauntearla y Snarl para hacerlo aun mas bulk y Protect que no necesita explicación.',0,'2014-11-15 00:16:31','2014-11-15 14:33:30',2,0,1,1,0,2,0,9,1),(41,'El Alfil',625,140,252,84,NULL,32,NULL,247,11,128,389,372,442,182,'Espero les sirva, me costo un tanto hacerlo (:',0,'2014-11-15 00:33:28','2014-11-18 03:01:07',1,-1,0,1,-1,1,0,12,1),(42,'Porengan\'s Vivillon',666,NULL,NULL,NULL,252,NULL,252,252,5,14,182,476,79,542,'Porengan uso este Vivillon en las Nacionales de Alemania. Lo uso acompañado de Mega Gyarados el cual tenia buena Sinergia para atraer Will-o-Wisp y ataques prioritarios y poder hacer Earthquake sin problemas. Sleep Powder practicamente no falla gracias a la Habilidad y Hurricane tiene su factor Hax gracias a la alta probabilidad de confundir al oponente.',NULL,'2014-11-15 00:38:11','2015-11-26 01:58:06',5,3,4,1,3,5,0,11,1),(43,'Kommander\'s NoSoyComida',398,4,252,NULL,NULL,NULL,252,197,11,22,370,413,38,369,'252+ Atk Choice Band Staraptor Close Combat vs. 252 HP / 4 Def Mega Kangaskhan: 212-250 (100 - 117.9%) -- guaranteed OHKO\r\n252+ Atk Choice Band Staraptor U-turn vs. 252 HP / 12 Def Gothitelle: 128-152 (72.3 - 85.8%) -- guaranteed 2HKO\r\n252+ Atk Choice Band Staraptor Close Combat vs. 252 HP / 180 Def Mega Tyranitar: 268-316 (129.4 - 152.6%) -- guaranteed OHKO\r\n-1 252+ Atk Choice Band Staraptor Double-Edge vs. 4 HP / 0 Def Mega Manectric: 127-151 (86.9 - 103.4%) -- 18.8% chance to OHKO\r\n252+ Atk Choice Band Staraptor Brave Bird vs. 252 HP / 188+ Def Amoonguss: 306-362 (138.4 - 163.8%) -- guaranteed OHKO\r\n252+ Atk Choice Band Staraptor Double-Edge vs. 252 HP / 108 Def Rotom-W: 135-160 (85.9 - 101.9%) -- 12.5% chance to OHKO (GG Lupin)\r\n\r\n',NULL,'2014-11-15 00:54:26','2015-11-27 03:44:02',5,3,4,1,3,5,0,6,1),(44,'Mega-Waifu',303,NULL,252,126,NULL,126,4,720,11,22,583,182,442,389,'',0,'2014-11-15 02:54:11','2014-11-15 03:02:13',0,0,0,0,0,0,0,17,1),(45,'Ludi-Loco ',272,244,NULL,188,NULL,76,NULL,135,2,44,252,503,58,298,'',NULL,'2014-11-15 04:39:43','2015-11-27 03:46:39',2,0,1,1,0,2,0,19,1),(46,'Follow Me or die!',36,252,NULL,152,NULL,104,NULL,135,2,98,266,322,236,500,'Puede llevar Mental Herb para prevenir Taunt y usar Cosmic Power sin fallas y luego Stored Power. Puede volverse también un solo support de Follow Me para ayudar al boost de un compañero, brindandole Sitrus Berry la ventaja de transformar un 2HKO en un 3HKO. Su habilidad le permite ignorar el daño de ataques de estado, hazards y climas, perfecto para un poke support.',NULL,'2014-11-15 14:31:50','2014-11-18 03:00:50',4,0,2,2,0,4,0,20,1),(47,'Guard Mime',122,252,NULL,252,NULL,NULL,NULL,196,2,43,252,469,501,269,'Mr. Mime support. Se come un Taunt y lo devuelve fácil, forzando el switch. Compañero perfecto del señor Charizard Y, por los Rock Slide de Tyranitar boosteado y Chomp, y por el Banded Bird de Talonflame.',NULL,'2014-11-15 14:42:58','2014-12-16 16:33:15',6,0,3,3,0,6,0,20,1),(48,'Llamita',609,188,0,152,166,NULL,4,683,3,151,257,247,412,237,'Mi set creado de Chandelure, con esos EV en Def y HP aguanta sin problemas un terremoto del Garchomp jolly o una shadow ball de M-gengar\r\nal primero lo mata con un Hidden Power Ice y al segundo con una Shadow Ball.\r\nSon libres de usarlo y modificarlo a gusto\r\nAtte Makise',NULL,'2014-11-15 15:58:27','2015-11-26 01:58:12',7,3,5,2,3,7,0,21,1),(49,'Set Mega Charizard Y',6,124,0,108,196,76,4,717,3,66,257,237,315,182,'Mi set para Mega Charizard Y, lo hice para la EvoPokémon World Cup, este set aguanta muchos golpes el 100% de las veces, tales como Rock Slide de Garchomp standar, Return de Mega Kangaskhan full Atk, Sucker Punch de Mega Mawile, Rock Slide de Salamence, Diversos Thunderbolt, Ancientpower de Mega Charizard, etc. \r\nAcaba el 100% de las veces los Mega Kangaskhan con Overheat, los Garchomp con Hidden Power Ice, Mega Manectric no bulky con Heat Wave, además de hacer 1HKO a varios Pokémon con Overheat. \r\nSu único defecto es su velocidad, recomiendo usarlo con Speed control para aumentar aun mas su rendimiento pero no es tan necesario, ya que aguanta bastante bien. ',NULL,'2014-11-15 20:40:46','2015-11-27 03:47:13',4,0,2,2,0,4,0,22,1),(50,'Bone\'s Exploud',295,168,NULL,84,252,4,NULL,274,3,113,586,58,126,411,'VGC\'14 está en su ocaso pero quizás el retorno a Hoenn permita a Exploud demostrar sus habilidades. El set que elegí para él está orientado para provocar el mayor daño posible ya que al ser lento, pocas veces tendrá dos chances de atacar. Sin perjuicio de lo anterior, sin invertir iv\'s en velocidad, Exploud es capaz de superar a Azumarril y M-Mawile con la posibilidad de provocarle 1OKHO a éste último gracias a fireblast. La distribución de ev\'s le permite, además, soportar un brave bird life orb de Talonflame adamant 252ivs en ataque y derrotarlo gracias a boomburst (úsese bajo su propio riesgo) e inclusive a través de un ice beam. También es capaz de soportar return de M-Kangaskhan jolly con la posiblidad de dejarlo fuera de combate por medio de focus blast con un 87,5% de posibilidades. Garchomp no será rival para Exploud soportando cualquiera de sus ataques para luego caer derrotado frente a rayo hielo. En general, es capaz de provocar daños considerables y con un compañero adecuado que le proteja de los tipo lucha se convierte en un Pokémon digno de atención.\r\n\r\nNota: Alternativa a Boomburst es Hyper voice, mientras que en lugar de Fireblast se puede probar con Overheat o Lanzallamas.',NULL,'2014-11-15 22:19:40','2015-11-27 03:45:27',3,1,2,1,1,3,0,7,1),(51,'♥~Lissa~♥ (MrPenguin93\'s Mawile)',303,244,60,44,NULL,132,28,720,14,22,182,442,583,389,'28 EVs outspeeds:\r\n-TheBattleRoom\'s Mawile & una mayoria de Azumarill\r\n\r\n-Todo Max Speed de base 81 e inferior con Nature favorable (Bajo Tailwind)\r\n\r\n-Todo Max Speed de base 95 e inferior con Nature Neutral (Bajo Tailwind)\r\n\r\nDamage Calcs:\r\n\r\n-1 252 Atk Garchomp Earthquake vs. 244 HP / 44 Def Mega Mawile: 68-84 (43.5 - 53.8%) -- 30.5% chance to 2HKO\r\n\r\n-1 252+ Atk Choice Band Talonflame Flare Blitz vs. 244 HP / 44 Def Mega Mawile: 132-156 (84.6 - 100%) -- 6.3% chance to OHKO\r\n\r\n-1 244+ Atk Life Orb Mamoswine Earthquake vs. 244 HP / 44 Def Mega Mawile: 96-117 (61.5 - 75%) -- guaranteed 2HKO\r\n\r\n+6 252+ Atk Huge Power Azumarill Aqua Jet vs. 244 HP / 44 Def Mega Mawile: 135-159 (86.5 - 101.9%) -- 12.5% chance to OHKO\r\n\r\n+1 252+ Atk Mold Breaker Mega Gyarados Earthquake vs. 244 HP / 44 Def Mega Mawile: 128-152 (82 - 97.4%) -- guaranteed 2HKO\r\n\r\n44 SpA Life Orb Talonflame Overheat vs. 244 HP / 132+ SpD Mega Mawile: 133-159 (85.2 - 101.9%) -- 18.8% chance to OHKO (Naughty / Naive)\r\n\r\n76 SpA Rotom-H Overheat vs. 244 HP / 132+ SpD Mega Mawile: 138-164 (88.4 - 105.1%) -- 37.5% chance to OHKO \r\n\r\n252+ SpA Choice Specs Hydreigon Earth Power vs. 244 HP / 132+ SpD Mega Mawile: 136-162 (87.1 - 103.8%) -- 25% chance to OHKO\r\n\r\n252+ SpA Life Orb Salamence Fire Blast vs. 244 HP / 132+ SpD Mega Mawile: 133-159 (85.2 - 101.9%) -- 12.5% chance to OHKO\r\n\r\n252+ SpA Ludicolo Scald vs. 244 HP / 132+ SpD Mega Mawile in Rain: 73-87 (46.7 - 55.7%) -- 69.9% chance to 2HKO (bajo Rain)\r\n\r\n252+ SpA Aegislash-Blade Shadow Ball vs. 244 HP / 132+ SpD Mega Mawile: 69-82 (44.2 - 52.5%) -- 20.3% chance to 2HKO\r\n\r\n252+ SpA Mega Manectric Overheat vs. 244 HP / 132+ SpD Mega Mawile: 138-164 (88.4 - 105.1%) -- 31.3% chance to OHKO\r\n\r\nNo incluyo calculos de como golpea porque tanto por su poca inversion en Attack como por Nature es de esperarse que no \"destruya\" lo que toca, de igual manera toma 2HKOs en practicamente todo lo que no lo resista, a cambio del bulk decente y la minima inversion en Speed. Funciona muy bien bajo Rain y bajo Trick Room con Tickle Gothitelle',NULL,'2014-11-15 22:22:37','2015-11-26 01:57:43',9,7,8,1,7,9,0,23,1),(52,'Mega-Mightyena',262,252,252,4,NULL,NULL,NULL,247,11,22,389,423,424,583,'Lista de OHKOS: Ferrothorn Garchomp Scrafty Hydreigon Salamance(Si el no le puso intimidate) Meowstic Alakazam Malamar\r\n\r\nLa megapiedra esta activada de por si no hace falta equiparla',NULL,'2014-11-16 01:21:12','2014-12-17 02:08:34',5,1,3,2,1,5,0,27,1),(53,'Señor bigote',593,248,NULL,44,NULL,216,NULL,211,4,11,503,105,92,58,'Este set es para matar de forma lenta y dolorosa. Scald por stab y porque puede quemar, ahora si vez que esto se demora mucho en resultar usa toxic, de pasada anulas las posibles recuperaciones que da restos (ojo que no es un bloqueo, sino que sumando y restando gana toxic).\r\nRecover para trolear, pero cuidado con confiarse de eso porque el pulpo no es rápido. \r\nFinalmente Ice Beam para los tipo planta o puede ser shadow ball por stab ',0,'2014-11-16 19:16:05','2014-11-18 03:00:19',2,0,1,1,0,2,0,28,1),(54,'Aegislash Duro de matar',681,252,8,120,8,120,NULL,682,23,176,430,247,588,164,'La idea de este evs spread es que aguante casi todo para activar el seguro de debilidad es sustituto es por que en algunas batallas el contrincante necesita dos pokemon para matar a tu aegislash y tal vez le toque hacer un cambio entonces tu metes el seguro por ejemplo un kangaskhan mega te hacer golpe bajo y el primer golpe lo recibe el sustituto y el segundo que viene que la mitad de poder lo recibe el aegislash entonces queda con buen hp y listo para pegar fuerte por el seguro de debilidad activado perdón si no explique bien no soy   muy bueno para esto XD un amigo lo usa así y es bastante bueno ',0,'2014-11-16 19:46:35','2014-11-17 01:09:15',1,1,1,0,1,1,0,29,1),(55,'VacaCuliá...ReCuliá',241,252,6,252,NULL,NULL,NULL,583,12,113,174,182,208,34,'Simple,but OP',NULL,'2014-11-16 19:59:02','2015-11-27 03:45:29',9,1,5,4,1,9,0,30,1),(56,'Mr. Myckey',184,148,48,156,NULL,156,NULL,682,11,37,453,127,583,182,'Un set algo personalizado, aguanta ataques de sus principales amenazas y las mata gracias al seguro debilidad\r\nY aunque no le activen su objeto igual pegara fuerte\r\nOjala les sirva\r\nSaludos',0,'2014-11-17 00:10:38','2014-11-17 01:09:00',1,1,1,0,1,1,0,21,1),(57,'Sawk Kangaskhan Slayer ',539,4,252,NULL,NULL,NULL,252,264,11,39,370,24,398,157,'El perfecto asesino de Kangaskhan mega gracias a su habilidad y el Double Kick para también eliminar a esos molestos Smeargles entonces es perfecto contra esa combinación de los pokemon antes \r\nmencionados  no hay mucho que decir es in típico 252 evs spread',NULL,'2014-11-17 01:14:51','2015-11-27 03:44:23',4,2,3,1,2,4,0,29,1),(58,'',713,252,NULL,252,NULL,4,NULL,211,22,20,174,105,419,360,'bueno, este pkmn es facil de criar ya que solo requere 4 Ivs perfectos, todos, vel. y atc.esp, la gracia es que sea lento, por eso es buena idea epezar con uno o dos \"Curse\", si es necesario usar recover, es bastante simple, y eso\r\n\r\nPD:como saben avalugg tiene + de 500 en def. pero - de 150 en def. sp, así que hay que asegurase de no tirarlo en contra de un atacante esp o mixto',NULL,'2014-11-17 20:46:13','2014-11-18 02:59:58',2,0,1,1,0,2,0,37,1),(59,'Absoleon #NoEvolucionoDeEevee',359,56,244,NULL,48,NULL,160,716,20,105,389,58,276,182,'Es un set mixto que fue modificado varias veces para counterear al Metagame con algo más bien diferente, Sucker Punch por STAB, Ice Beam para darle OHKO a Garchomp y el Spread de velocidad permite pasarlo por un punto. Superpower para bajarse a M-Kangaskhan y Protect porque sí xD. La idea es pegar siempre por debilidad.\r\n\r\nSi sacrificamos el STAB de Sucker Punch/Night Slash podemos meter Rock Slide para asegurar OHKO a Talonflame y M-Charizard Y, siempre y cuando tengamos algo para protegerse del Brave Bird. Dejo algunos cálculos.\r\n\r\nDEFENSIVOS:\r\n\r\n244 Atk Mega Absol Rock Slide vs. 4 HP / 0 Def Talonflame: 184-220 (119.4 - 142.8%) -- guaranteed OHKO\r\n\r\nLo destruye, siempre y cuando no reciba el Flare Blitz o Brave Bird.\r\n\r\n244 Atk Mega Absol Rock Slide vs. 0 HP / 0 Def Mega Charizard Y: 176-208 (115 - 135.9%) -- guaranteed OHKO\r\n\r\nIdem, salvo que a M-CharY lo outspeedeamos.\r\n\r\n48 SpA Mega Absol Ice Beam vs. 0 HP / 0 SpD Garchomp: 184-220 (100.5 - 120.2%) -- guaranteed OHKO\r\n\r\nSalvo que Garchomp esté scarfeado, no tiene nada que hacer. El spread permite outspeedearlo por 1 punto.\r\n\r\n48 SpA Mega Absol Ice Beam vs. 0 HP / 0 SpD Salamence: 192-228 (112.9 - 134.1%) -- guaranteed OHKO\r\n\r\nIdem, si no está scarfeado, Absol wins.\r\n\r\n244 Atk Mega Absol Superpower vs. 4 HP / 0 Def Kangaskhan: 182-216 (100.5 - 119.3%) -- guaranteed OHKO\r\n\r\nLa prueba de fuego, y la pasa rozando. Ojo que si bien ahora anda mucho Kanga con EVs en HP, no los va a matar, pero les va a hacer un daño bastante considerable.\r\n\r\nDEFENSIVOS:\r\n\r\n252 Atk Kangaskhan Return vs. 56 HP / 0 Def Mega Absol: 106-126 (72.1 - 85.7%) -- guaranteed 2HKO\r\n\r\n252+ Atk Choice Band Talonflame Brave Bird vs. 56 HP / 0 Def Mega Absol: 186-219 (126.5 - 148.9%) -- guaranteed OHKO\r\n\r\nNada que hacer ahí, solo llamar a Tyranitar.\r\n\r\n252 SpA Mega Charizard Y Heat Wave vs. 56 HP / 0- SpD Mega Absol in Sun: 177-208 (120.4 - 141.4%) -- guaranteed OHKO\r\n\r\n252 SpA Mega Charizard Y Focus Blast vs. 56 HP / 0- SpD Mega Absol: 264-312 (179.5 - 212.2%) -- guaranteed OHKO\r\n\r\nNuevamente, nada que hacer, pero lo matamos antes de que ataque xD\r\n\r\n252 Atk Life Orb Garchomp Earthquake vs. 56 HP / 0 Def Mega Absol: 125-148 (85 - 100.6%) -- 6.3% chance to OHKO\r\n\r\nNo está mal.\r\n\r\nComo vemos, no aguanta mucho, asi que la idea es estar seguro de lo que podemos outspeedear y matar antes que nos maten. Es un buen Anti-Meta para juegos amistosos.\r\n',NULL,'2014-11-17 21:59:59','2015-11-27 03:45:34',5,1,3,2,1,5,0,38,1),(60,'DePTScon♥',373,12,NULL,12,228,4,252,264,5,22,157,434,406,126,'Pokémon Ganador del 1er Permier de Perú\r\n\r\n-12 EVs en HP y 12 EVs en defensa para resistir Dragon Claw de Garchomp Life Orb jolly (ya nadie temible usa Lum Berry).\r\n-252 EVs en velocidad por si alguien más traía a Salamence y yo no tenía a Azumarill detrás.\r\n\r\nDebilidades: Rock, Ice x4, Dragon, Fairy\r\nResistencias: Water, Grass ¼, Fire, Fighting, Bug\r\nInmunidad: Ground\r\n\r\nDebía utilizarlo alguna vez, es un pokémon muy especial al cual le tengo mucho cariño, ya que para Homero de PTS fue difícil criarlo con 6 ivs, aparte significaba mi aceptación en Pokémon Trainers Santiago a pesar de ser extranjero, gracias cabros. Sin duda el Intimidate para mí en un equipo de control era totalmente necesario, podía otorgarle más resistencia a Tyranitar, el cual gracias a la arena tiene buen special bulky y a Azumarill, el cual podría también ser beneficiado por Intimidate, aparte de ello, me permitía controlar a otros dragones, pues Salamence scarf es el más rápido (no les temo a Garchomp o Noivern scarf, no son muy viables en mi opinión), con el uso aumentado de Hydreigon, por qué no volver al pasado y traer a este majestuoso dragón que pronto tendrá mega?. Rock Slide me sirvió mucho en la final y fue el reemplazo de Sleep Talk, sabía que en un torneo tan importante nadie traería Dark Void, pues es muy tirado a la suerte, a menos que seas el Presi, él sí lo usa muy bien. Me daba cobertura contra Ferrothorn/Scizor y Charizard /Talonflame.\r\n\r\n-Kommander',NULL,'2014-11-19 05:07:48','2015-11-26 01:58:13',5,3,4,1,3,5,0,6,1),(61,'Trapito Bonito',354,252,NULL,62,NULL,196,NULL,707,14,119,421,50,182,261,'Uno de los pocos nichos de Mega Banette está en el Prankster Disable (el otro importante siendo Prankster Destiny Bond), el cual permite inhabilitar a casi cualquier usuario de Choice Items (con excepción de Talonflame usando Brave Bird). Frisk ayuda a identificar los objetos de los rivales y ayuda con el truco del set. \r\n\r\nShadow Claw es el único ataque del set, más que nada para no ser arruinado por Taunt (otros ataques pueden ser usados, Phantom Force o Shadow Sneak son buenas opciones con STAB). Protect está aquí por razones obvias y en caso de necesitar un turno para megaevolucionar sin mucho problema. Disable con Prankster es un movimiento bastante útil, sobre todo cuando un oponente está lockeado en un movimiento. Will-O-Wisp ofrece la siempre útil quemadura aunque puede ser remplazado por otro movimiento de así quererse.\r\n\r\nPor el lado defensivo es capaz de sobrevivir Shadow Ball de Aegislash Max. Sp. Atk un 100% de las veces (y si lo encuentra en Blade Forme logra el OHKO de vuelta con Shadow Claw, lo cual no es imposible dado que en el primer turno Banette es más lento) y el Brave Bird de Choice Band Talonflame sólo tiene un 6.3% de probabilidad de OHKO.\r\n\r\nEl set carece de recuperación confiable y una verdadera presencia ofensiva por lo que no es tan viable como se quisiera, pero puede rendir como un mega secundario dependiendo de el equipo.',NULL,'2014-11-19 13:15:47','2014-11-19 13:15:47',0,0,0,0,0,0,0,41,1),(62,'JackieChan',620,36,220,NULL,NULL,NULL,252,252,16,39,469,136,501,282,'Mienshao es un pokémon bastante interesante, es poseedor de un buen daño y velocidad que les permite tener acceso al Quick Guard más rápido de VGC2014 que permitía parar a Meowstic y al 99% de los Fake Out (Maldito Raichu ...)  además que es de los pocos que puede aprender Quick Guard y Wide Guard\r\n\r\nEste Mienshao fue pensado para ser el mejor compañero de Mega Charizard X a la hora de setear un Dragon dance y para ser el Kanga Killer del equipo en caso de que la cosa se ponga fea :D, los EV son bastante comunes con el detalle de que se ajustó el ataque para hacerle OHKO a Kangaskhan en sus muchas variantes dejando un poco para HP y aguantar un poco extra (realmente poco), ahora entrando en detalle:\r\n\r\nItem: \r\nFocus Sash : Simplemente para que Mienshao no cayera instantáneamente ante cosas como Talonflame y permitirle setear a Charizard X\r\n\r\nHabilidad:\r\nInner Focus: Sólo por los muchos Raichus que me he topado, para todo lo demás existe Quick Guard (Hablando en VGC2014)\r\n\r\nAtaques : Objetivo\r\nWide Guard : Cubrir a Charizard X de Earthquake y Rockslide\r\nHigh Jump Kick: El Ataque Kanga Killer y además gracias a su potencia permitía repartir buen daño a todo lo que se le cruzara (sin contar fantasmas claramente :D)\r\nQuick Guard: Cubrir a Charizard de Pranksters, cubrirse a si mismo de Talonflame y como bonus tenía el factor sorpresa de que no todos esperaban ambas Guard\r\nKnock Off: Cobertura para fantasmas y además quita el item que mejor\r\n\r\n\r\nVariante:\r\nLa versión anterior tenía la habilidad Regenerator que también funcionaba bastante bien\r\n\r\nPalabras al cierre:\r\n\r\nEste pokémon fue uno de los primeros que usé en mi introducción al mundo competitivo de pokémon este año, lo usé en ambos torneos a los que fui ( Evopokémon World Cup y Pokémon Deathmatch 2014), su spread fue craneado en conjunto a mi sensei en pokémon Hopeth que me arrastro al competitivo :D',0,'2014-11-19 13:40:51','2014-11-19 22:57:27',3,-1,1,2,-1,3,0,42,1),(63,'Anti-Garchomp',723,252,NULL,48,196,NULL,12,247,3,26,237,85,315,182,'Este set esta hecho para enfrentarse a dragones, especificamente Garchomp ya que como es muy frecuente que tenga Lum Berry no rinde quemarlo con WoW, sale mucho mas rapido deshacerse de él de un HP Ice. Se quitó Will-o-Wisp ya que contra los dos megas mas usados y Garchomp no rinde tanto.\r\nvs Mega Mawile, conviene mas usar Overheat\r\nvs Mega Kangaskhan, un doble Power up Punch deja sin efecto la baja en ataque de la quemadura\r\nvs Garchomp, se usa HP Ice.\r\n\r\nLos EVs estan dados justo para darle OHKO a Garchomp con HP Ice\r\nlos 12ev en speed son para outspeedear otros Rotom, los evs sobrantes a defensa para aguantar mejor los rock slide.',NULL,'2014-11-20 19:00:04','2015-11-27 03:45:36',5,1,3,2,1,5,0,5,1),(64,'Supportaque',210,232,4,252,NULL,NULL,NULL,211,11,22,215,339,370,89,'Heal Bell (Campana Cura) puede ser sustituida por Toxic(Tóxico) o Thunder Wave (Onda Trueno), preferentemente en los casos que no se cuente con algun pokemon con ataques de modificación de estados. Cabe destacar que este set está pensado para batallas dobles más que para individuales.',NULL,'2014-11-23 02:58:48','2015-03-18 13:52:25',4,-2,1,3,-2,4,0,43,1),(65,'Swagdevoir al ataque',282,180,NULL,NULL,176,NULL,152,264,3,140,94,585,605,85,'Con los 180 ev en speed Outspeedea pokemon de base 110, con esos 180 ev en HP aguanta un sludge bomb de gengar timid 252 Sp.atack y los ev en Sp. Atk son suficientes para hacerle OHKO a garchomp.',NULL,'2014-11-25 00:06:43','2015-11-27 03:44:33',4,2,3,1,2,4,0,44,1),(66,'Togekiss inmovilizador ',468,244,NULL,NULL,60,206,NULL,194,4,32,403,355,86,605,'este togekiss esta echo para ser una molestia para los oponentes, empezar en el mayor de los casos con \'\'Thunder Wave\'\' para paralizar al oponente y ser mas rápido que el , gracias a su habilidad \'\'Serene Grace\'\'  que sube la probabilidad de efectos secundarios en los ataques \'\'Air Slash\'\' tiene mucha facilidad de hacer retroceder al oponente, así provocando que si no retrocede se paralizara y si no se paraliza este retrocedera,\'\'Roost\'\' es para molestar mas al oponente ya que si llega a poder atacar esto te permitira obtener recuperar  puntos \'\'HP\'\', y finalmente \'\'Dazzling Gleam\'\' para derrotar pokemon\'s tipo dragon de solo 1 golpe.\r\n\r\ny como objeto alternativo \'\'Quick Claw\'\' para si el oponente es mas rápido (ya que este togekiss no es para nada de velocidad) \'\'Quick Claw\'\' le permitira empezar con un \'\'Shock Wave\'\' sin a ver recibido daño.',0,'2014-11-25 04:48:27','2015-03-18 13:51:54',3,-1,1,2,-1,3,0,45,1),(67,'EvoPokémon\'s Mega Slowbro',80,252,NULL,NULL,44,212,NULL,752,2,144,347,126,473,58,'252 Atk Parental Bond Mega Kangaskhan Double-Edge vs. 252 HP / 0+ Def Slowbro: 82-99 (40.5 – 49%) — guaranteed 3HKO\r\n252+ Atk Huge Power Mega Mawile Play Rough vs. 252 HP / 0+ Def Slowbro: 79-94 (39.1 – 46.5%) — guaranteed 3HKO\r\n252 SpA Life Orb Hydreigon Dark Pulse vs. 248 HP / 216 SpD Slowbro: 166-198 (82.5 – 98.5%) — guaranteed 2HKO\r\n\r\nArticulo completo en http://www.evopokemon.com/mega-slowbro-1862\r\nEscrito originalmente por Kommander y Jasper',NULL,'2014-12-13 17:27:40','2015-03-18 13:51:43',1,-1,0,1,-1,1,0,5,1),(68,'EvoPokémon\'s Mega Sableye',302,252,NULL,44,NULL,212,NULL,746,24,158,196,269,105,282,'252+ SpA Mega-Gardevoir Pixilate Hypervoice vs 252 HP/212+ SpD Mega-Sableye 132 – 156 (84 – 99.3%) Guaranteed 2HKO\r\n252+ SpA Choice Specs Hydreigon Draco Meteor vs 252 HP/212+ SpD Mega-Sableye 120 – 142 (76.4 – 90.4%) Guaranteed 2HKO\r\n252+ SpA Mega-Charizard Y Heat wave in sun vs 252 HP/212+ SpD Mega-Sableye 79 – 94 (50.3 – 59.8%) 87.5% chance of 2HKO\r\n252+ SpA Aegislash-Blade Shadow Ball vs 252 HP/212+ SpD Mega-Sableye 57 – 67 (36.3 – 42.6%) Guaranteed 3HKO\r\n252 Atk Mega-Salamence Aerilate Return vs 252 HP/44 Def Mega-Sableye 99 – 117 (63 – 74.5%) Guaranteed 2HKO\r\n252 Atk Mega-Salamence Aerilate Double Edge vs 252 HP/44 Def Mega-Sableye 115 – 136 (73.2 – 86.6%) Guaranteed 2HKO\r\n\r\nArticulo completo en http://www.evopokemon.com/road-oras-mega-sableye-1852\r\nEscrito originalmente por Ignacio Rolin',NULL,'2014-12-13 17:36:12','2014-12-13 17:36:12',0,0,0,0,0,0,0,5,1),(69,'EvoPokemon\'s Mega Glalie físico',362,100,NULL,NULL,252,NULL,156,755,11,39,216,89,420,153,'El EV spread permite outspeedear a Timid/Miedoso Smeargle máx speed por un punto con naturaleza Firme/Adamant, y el resto de los EVs van a bulk para poder resistir algo más los golpes, considerando que más speed será mejor entregarlo a través de un compañero dado que por sí solo no outspedeará nada que valga la pena con sus solo 100 de base\r\n\r\n252+ Atk Mega Glalie Ice Shard vs. 0 HP / 4 Def Garchomp: 148-180 (80.8 – 98.3%) — guaranteed 2HKO\r\n252+ Atk Refrigerate Mega Glalie Return vs. 0 HP / 4 Def Garchomp: 492-580 (268.8 – 316.9%) — guaranteed OHKO\r\n252+ Atk Mega Glalie Ice Shard vs. 0 HP / 0 Def Mega Sceptile: 184-220 (126.8 – 151.7%) — guaranteed OHKO\r\n252+ Atk Refrigerate Mega Glalie Return vs. 252 HP / 0 Def Mega Salamence: 376-448 (186.1 – 221.7%) — guaranteed OHKO\r\n252+ Atk Refrigerate Mega Glalie Explosion vs. 252 HP / 0 Def Mega Kangaskhan: 216-255 (101.8 – 120.2%) — guaranteed OHKO\r\n\r\nArticulo completo en http://www.evopokemon.com/road-mega-glalie-1820\r\nEscrito originalmente por Eduardo Castro',NULL,'2014-12-13 17:44:49','2015-03-18 13:51:31',1,-1,0,1,-1,1,0,5,1),(70,'EvoPokemon\'s Mega Glalie especial',362,100,NULL,NULL,252,NULL,156,755,3,39,58,311,63,182,'La idea es tener Día soleado/Sunny Day activo para entregar un mejor coverage frente a los oponentes de acero gracias a Meteorobola/Weather Ball.\r\n\r\n252+ SpA Mega Glalie Weather Ball (100 BP Fire) vs. 252 HP / 4 SpD Mega Mawile in Sun: 184-218 (117.1 – 138.8%) — guaranteed OHKO\r\n252+ SpA Mega Glalie Weather Ball (100 BP Fire) vs. 252 HP / 0 SpD Aegislash-Shield in Sun: 126-150 (75.4 – 89.8%) — guaranteed 2HKO\r\n\r\nArticulo completo en http://www.evopokemon.com/road-mega-glalie-1820\r\nEscrito originalmente por Rodrigo Vega',NULL,'2014-12-13 17:50:29','2014-12-13 19:18:56',0,0,0,0,0,0,0,5,1),(71,'EvoPokemon\'s Mega Steelix',208,200,252,56,NULL,NULL,NULL,753,11,125,89,157,442,182,'Mega Steelix puede ser un buen mega que pueda aguantar a varios del meta actual, sin embargo, esto solo se da por el lado físico, ya que del lado especial es muy difícil que pueda aguantar algo. Esperemos que en el siguiente VGC Tyranitar o Hippowdon sean pokemon disponibles de usar, ya que le permitirian ayudar a M-Steelix a atacar más fuerte gracias a su habilidad.\r\n\r\nArticulo completo en http://www.evopokemon.com/analisis-mega-steelix-1772\r\nEscrito originalmente por Diego Aguilera',NULL,'2014-12-13 18:08:09','2015-03-18 13:50:56',1,1,1,0,1,1,0,5,1),(72,'EvoPokemon\'s Mega Beedrill',15,4,252,NULL,NULL,NULL,252,760,11,68,404,369,398,529,'252+ Atk Adaptability Mega Beedrill Poison Jab vs. 4 HP / 0 Def Mega Charizard Y: 136-162 (88.3 – 105.1%) — 31.3% chance to OHKO\r\n252+ Atk Adaptability Mega Beedrill X-Scissor vs. 252 HP / 100 Def Cresselia: 180-212 (79.2 – 93.3%) — guaranteed 2HKO\r\n252+ Atk Mega Beedrill Drill Run vs. 4 HP / 0 Def Mega Manectric: 136-160 (93.1 – 109.5%) — 56.3% chance to OHKO\r\n\r\nArticulo completo en http://www.evopokemon.com/analisis-mega-beedrill-1750\r\nEscrito originalmente por Lukas Hernández',NULL,'2014-12-13 18:13:02','2015-03-18 13:50:30',1,1,1,0,1,1,0,5,1),(73,'EvoPokemon\'s Mega Audino',531,252,NULL,244,NULL,12,NULL,749,2,144,220,270,505,433,'El netamente Roomer, su función es settear TR, apoyar con Helping Hand y curar con Heal Pulse cuando sea necesario, Pain Split con una doble función, para no morir en la batalla y quitar HP al rival.\r\n\r\n252+ Atk Parental Bond Mega Kangaskhan Return vs. 252 HP / 244+ Def Mega Audino: 87-103 (41.4 – 49%) — guaranteed 3HKO\r\n252+ Atk Life Orb Protean Greninja Gunk Shot vs. 252 HP / 244+ Def Mega Audino: 148-174 (70.4 – 82.8%) — guaranteed 2HKO\r\n252+ Atk Choice Band Reckless Staraptor Brave Bird vs. 252 HP / 244+ Def Mega Audino: 118-141 (56.1 – 67.1%) — guaranteed 2HKO\r\n\r\nArticulo completo en http://www.evopokemon.com/mega-audino-1722\r\nEscrito originalmente por FRIKI',NULL,'2014-12-13 18:31:31','2015-03-18 13:50:16',1,-1,0,1,-1,1,0,5,1),(74,'EvoPokemon\'s Mega Pidgeot',18,4,252,NULL,NULL,NULL,252,754,5,51,257,542,369,182,'252 SpA Pidgeot Hurricane vs. 164 HP / 4 SpD Assault Vest Ludicolo: 132-156 (75 – 88.6%) — guaranteed 2HKO\r\n252 SpA Pidgeot Hurricane vs. 252 HP / 0 SpD Mega Venusaur: 168-198 (89.8 – 105.8%) — 31.3% chance to OHKO\r\n\r\nArticulo completo en http://www.evopokemon.com/mega-pidgeot-1714\r\nEscrito originalmente por Jorge Tapia',NULL,'2014-12-13 18:35:10','2015-03-18 13:50:10',1,-1,0,1,-1,1,0,5,1),(75,'EvoPokemon\'s Mega Loppuny',428,4,252,NULL,NULL,NULL,252,758,16,7,252,136,216,8,'El EV Spread es básico, al igual que los movimientos. Su Fake Out es uno de los mas rápidos del juego si es que entra en otro turno ya Mega evolucionada. High Jump Kick es el pequeño regalo que se le dio a Lopunny para aprovechar su buenos stats. Return no conseguirá muchos KO.\r\n\r\n252 Atk Lopunny High Jump Kick vs. 252 HP / 0 Def Aegislash-Shield: 164-194 (98.2 – 116.1%) — 87.5% chance to OHKO\r\n(Siendo Adamant, es OHKO asegurado: 107.7 – 126.9%)\r\n\r\n252 Atk Lopunny High Jump Kick vs. 252 HP / 0 Def Mega Kangaskhan: 230-272 (108.4 – 128.3%) — guaranteed OHKO\r\n252 Atk Lopunny High Jump Kick vs. 6 HP / 0 Def Mega Kangaskhan: 230-272 (127 – 150.2%) — guaranteed OHKO\r\n252 Atk Lopunny Ice Punch vs. 6 HP / 0 Def Garchomp: 184-220 (100 – 119.5%) — guaranteed OHKO\r\n-1 252+ Atk Lopunny High Jump Kick vs. 252 HP / 0 Def Scrafty: 152-180 (88.3 – 104.6%) — 25% chance to OHKO\r\n\r\nArticulo completo en http://www.evopokemon.com/road-oras-mega-lopunny-1698\r\nEscrito originalmente por Ymir Tarzen\r\n',NULL,'2014-12-13 18:40:38','2015-11-27 03:45:40',3,1,2,1,1,3,0,5,1),(76,'EvoPokemon\'s Mega Altaria',334,252,NULL,NULL,84,172,NULL,747,24,30,304,58,257,538,'252 SpA Life Orb Protean Greninja Ice Beam vs. 252 HP / 172+ SpD Mega Altaria: 133-156 (73 – 85.7%) — guaranteed 2HKO\r\n\r\n252+ SpA Aegislash-Blade Flash Cannon vs. 252 HP / 172+ SpD Mega Altaria: 126-150 (69.2 – 82.4%) — guaranteed 2HKO\r\n\r\n252 SpA Mega Gengar Sludge Bomb vs. 252 HP / 172+ SpD Mega Altaria: 140-168 (76.9 – 92.3%) — guaranteed 2HKO\r\n\r\n156 Atk Tough Claws Mega Metagross Bullet Punch vs. 252 HP / 0 Def Mega Altaria: 86-104 (47.2 – 57.1%) — 91.4% chance to 2HKO\r\n\r\nArticulo completo en http://www.evopokemon.com/road-oras-la-esponja-voladora-mega-altaria-1673\r\nEscrito originalmente por Miguel Adofacci y Rodrigo Vega',NULL,'2014-12-13 18:47:53','2015-03-18 13:49:57',1,1,1,0,1,1,0,5,1),(77,'EvoPokemon\'s Mega Gallade',475,NULL,252,4,NULL,NULL,252,748,16,154,370,428,8,182,'Este set se basa en explotar los puntos fuertes de Mega Gallade, a través de un spread de physical sweeper. La habilidad no importa demasiado, ya que en general estaremos mega evolucionando a Gallade de inmediato, sin embargo Justified podría ayudar en un switch contra un predicted Crunch o bien que decidamos NO megaevolucionar en el primer turno intentando absorber un predicted Sucker Punch, pero no lo recomiendo ya que la defensa física de Gallade previo a Mega Evolucionar no es muy alta, y recibiremos mucho daño considerando el spread.\r\n\r\n252 Atk Mega Gallade Close Combat vs. 4 HP / 0 Def Mega Kangaskhan: 246-290 (135.9 – 160.2%) — guaranteed OHKO\r\n252 Atk Mega Gallade Ice Punch vs. 0 HP / 4 Def Garchomp: 212-252 (115.8 – 137.7%) — guaranteed OHKO\r\n\r\nArticulo completo en http://www.evopokemon.com/road-oras-el-ultra-heroe-mega-gallade-1641\r\nEscrito originalmente por Rodrigo Vega',NULL,'2014-12-13 19:03:10','2014-12-16 16:49:46',1,1,1,0,1,1,0,5,1),(78,'EvoPokemon\'s Mega Sharpedo',319,NULL,252,NULL,54,NULL,204,751,10,3,242,127,58,182,'52 SpA Mega Sharpedo Ice Beam vs. 4 HP / 0 SpD Mega Salamence: 172-204 (100.5 – 119.2%) — guaranteed OHKO\r\n\r\nMega Sharpedo no posee los stats ni la habilidad más impresionante pero definitivamente tiene las herramientas necesarias para hacerse cargo de algunos futuros gigantes del metagame, por supuesto, con el apoyo necesario (como cualquier Pokémon). Aún con algunos incrementos en sus defensas sigue siendo muy frágil y susceptible a la prioridad así que debe ser utilizado con cuidado y énfasis en lo que es bueno. Su velocidad de 105 lo pone por encima de gran parte del meta, incluyendo a Garchomp y gracias a su forma regular puede ir aun más rápido. Lo más probable es que Mega Sharpedo no pase desapercibido en el futuro porque tan “malo” no es.\r\n\r\nArticulo completo en http://www.evopokemon.com/road-oras-mega-sharpedo-1649\r\nEscrito originalmente por Yonathan Pérez',NULL,'2014-12-13 19:17:02','2015-03-18 13:49:24',1,-1,0,1,-1,1,0,5,1),(79,'EvoPokemon\'s Mega Salamence especial',373,4,NULL,NULL,252,NULL,252,759,3,22,434,304,126,182,'Lamentablemente, a diferencia de casi todos los otros megas usados en VGC, Mega-Salamence es INCAPAZ de dañar considerablemente a los megas más comunes de este año; Kangaskhan y Mawile:\r\n\r\n252+ SpA Aerilate Salamence Hyper Voice vs. 4 HP / 0 SpD Mega Kangaskhan: 78-93 (43 – 51.3%) — 5.5% chance to 2HKO\r\n252+ SpA Salamence Draco Meteor vs. 4 HP / 0 SpD Mega Kangaskhan: 117-138 (64.6 – 76.2%) — guaranteed 2HKO\r\n252+ SpA Salamence Fire Blast vs. 252 HP / 60 SpD Mega Mawile: 128-152 (81.5 – 96.8%) — guaranteed 2HKO\r\nTampoco tiene un buen match-up contra mega Metagross, el cual le da OHKO con Ice Punch y Fire Blast es incapaz de matarlo:\r\n\r\n252+ SpA Salamence Fire Blast vs. 100 HP / 4 SpD Metagross: 120-142 (71.4 – 84.5%) — guaranteed 2HKO\r\n\r\n¿Por qué entonces discutir un set que parece ser tan malo? La razón es que Salamence puede ser un late game cleaner, obteniendo los KOs toda vez que el equipo rival haya sido dañado previamente. Si algo nos enseñó Talonflame es que volador es un tipo de ataque muy efectivo en VGC.\r\n\r\nArticulo completo en http://www.evopokemon.com/mega-salamence-oras-1617\r\nEscrito originalmente por Lito',NULL,'2014-12-13 19:24:53','2015-03-18 13:49:17',1,1,1,0,1,1,0,5,1),(80,'EvoPokemon\'s Mega Salamence físico',373,252,252,NULL,NULL,4,NULL,759,11,22,349,216,89,182,'Con un ataque base de 145 lo natural es escoger un set que lo aproveche. Adicionalmente, cuenta con Dragon Dance lo que libera EVs de speed y nos deja usar Adamant sin problemas. En efecto con 0 EVs y un Dragon Dance, Mega-Salamence tiene 210 de velocidad… los suficientes para ganarle a mega Aerodactyl sin problemas (quien tiene “sólo” 202).\r\n\r\nNo incluyo un ataque Dragon porque 1) todos los dragones mueren de un +1 Return y 2) los ataques Dragon son inmunes por un tipo… no así volador. Los EVs maximizan el bulk general y el ataque. Jamás vivirá un Ice Beam así que es irrelevante intentarlo (no en vano con Nicolás del Campo creemos que Greninja será muy bueno en este meta). A pesar de esto, logra vivir HP ice de mega Manectric Modest:\r\n\r\n252+ SpA Mega Manectric Hidden Power Ice vs. 252 HP / 4 SpD Salamence: 168-200 (83.1 – 99%) — guaranteed 2HKO\r\n\r\n+1 252+ Atk Aerilate Salamence Return vs. 4 HP / 0 Def Mega Kangaskhan: 204-240 (112.7 – 132.5%) — guaranteed OHKO\r\n+1 252+ Atk Salamence Earthquake vs. 252 HP / 60 Def Mega Mawile: 120-142 (76.4 – 90.4%) — guaranteed 2HKO\r\n+1 252+ Atk Salamence Earthquake vs. 100 HP / 0 Def Metagross: 108-128 (64.2 – 76.1%) — guaranteed 2HKO\r\nSi bien parece difícil usar Dragon Dance, con buenos compañeros uno siempre puede hallar la ocasión, tal como nos enseñó Mega Tyranitar o Charizard X en VGC14. Este ejercicio nos muestra además que Mawile seguirá más vivo que nunca en VGC15.\r\n\r\nArticulo completo en http://www.evopokemon.com/mega-salamence-oras-1617\r\nEscrito originalmente por Lito',NULL,'2014-12-13 19:28:41','2015-11-27 03:45:42',3,1,2,1,1,3,0,5,1),(81,'EvoPokemon\'s Mega Sceptile especial',254,4,NULL,NULL,252,NULL,252,745,3,65,437,406,182,237,'La idea de este moveset es que siempre tiene que tener un Pokémon que sea el support de Mega Sceptile, por que como verán, Mega Sceptile no tiene muchas defensas, lo que lo hace blanco fácil, por eso siempre es bueno tener al lado su buen compañero. Este podría ser Aerodactyl, ya que entre los 2 pueden deshacerse de sus counters por tipo, la roca derrota 4 debilidades de la planta, al igual que Sceptile puede derrotar a los counters de su compañero, otra opción es tener un Pokémon tipo eléctrico con Discharge, asi activando su habilidad pararrayos atacara a su enemigo y además Sceptile recibirá el Boosteo para atacar todavía mas cerdo.\r\n\r\nEl Moveset esta pensado para atacar con su mayor potencial de acuerdo a sus tipos y stab. Los Hidden Powers pueden usarse de acuerdo al team que quieran usar, por ejemplo, el HP Ice es funcional con los tipos que son x4 debiles a este tipo, mas que nada dragones, algunos diran: Pero es Dragon, puede derrotarlos de un golpe!... Posiblemente si, pero esta opción es buena para dejarlo totalmente K.O sin tener la duda de que lo matara o no. El HP Fire es para los tipo aceros, si bien los cálculos no aseguran un K.O, si se le acompaña con un Pokemon Helping Hand, el k.o es 100% seguro a cualquier acero o dejándolo en rojo de una, cosa de derrotarlo fácilmente después. Por ultimo el HP Rock para mi al menos es el mejor HP para un tipo planta, por que derrota fácilmente la mayoría de los Pokemon que le ganan al planta, por ejemplo si saliera un Bicho/Volador, el HP Rock lo derrota fácil, si sale un Mega Charizard Y, muere fácil de un solo HP Rock. Cabe destacar que Mega Sceptile funciona en la mayoría de los climas, como el Sol y la Lluvia.\r\n\r\nArticulo completo en http://www.evopokemon.com/road-oras-mega-sceptile-1624\r\nEscrito originalmente por Vincent',NULL,'2014-12-13 20:05:25','2015-11-27 03:45:43',3,1,2,1,1,3,0,5,1),(82,'EvoPokemon\'s Mega Sceptile físico',254,NULL,252,NULL,NULL,4,252,745,11,65,348,337,157,182,'Este moveset esta pensado para golpear por stab igualmente, aunque el Dragon Claw lo veo un poco mas opcional mas que nada, ya que con otros movimientos podría quedar mejor, no sale del parámetro que es bueno tener un compañero ojala fake out + Quick Guard, ya que se rumorea de que el pajarito desgraciado llamado Talonflame volverá DDDD;!!!! Asi que, es mejor asegurar el K.O seguro a esa cosa con su buen Fake Out y Rock Slide. El Rock Slide funciona bien ya que funciona igual como el HP Rock revisado anteriormente (claro esta que me refiero a su utilidad por tipo) e incluso mejor por que golpearía mas todavía y golpearía a los 2. \r\n\r\nOpcionales: Earthquake funciona derrotando ya a muchos pokemons con mega Evoluciones actuales, como Mega Metagross, Mega Manectric y Mega Mawile, ciertamente a ningún derrotaría ya sea por su alta defensa o su habilidad, pero los dejara bastante graves haciendo que no puedan sobrevivir un turno mas. Aerial Ace funciona ya para no fallar los ataques y para dejar a otro compañero planta en desventaja total. Power-Up-Punch funciona de una manera bastante buena ya que compensa la “falta” de poder en el ataque de este Pokemon, además que boostearia completamente a Mega Sceptile.\r\n\r\nArticulo completo en http://www.evopokemon.com/road-oras-mega-sceptile-1624\r\nEscrito originalmente por Vincent',NULL,'2014-12-13 20:11:01','2015-03-18 13:48:36',2,0,1,1,0,2,0,5,1),(83,'EvoPokemon\'s Mega Metagross',376,100,156,NULL,NULL,NULL,252,750,16,29,418,8,157,182,'Este spread sobrevive el Dark Pulse de Timid Greninja Life Orb\r\nVive el Flare Blitz de Jolly Talonflame Life Orb\r\nGenera el tan odiado Speed Tie Talonflame Adamant\r\nVive al Fire Blast de Mega-Salamence Modest\r\nPuede hacer OHKO a los Charizard-Y diseñados para resistir Rock Slide de Garchomp\r\nResiste Shadow Ball de Aegislash Blade un 50% de las veces, el Mega-Gallade Shadow Claw y Earthquake Critico de Garchomp.\r\n\r\nArticulo completo en http://www.evopokemon.com/megametagross-1587\r\nEscrito originalmente por Sh4dowzon',NULL,'2014-12-13 20:23:04','2015-11-27 03:44:36',4,2,3,1,2,4,0,5,1),(84,'Pachamama (Pephan\'s XL Gourgeist)',711,156,NULL,212,NULL,140,NULL,196,22,119,402,567,433,261,'',NULL,'2014-12-15 03:30:31','2015-03-18 13:47:46',3,-1,1,2,-1,3,0,49,1),(86,'MSwampert',260,50,252,100,NULL,108,NULL,744,11,67,89,127,8,182,'',NULL,'2014-12-16 14:04:27','2015-01-16 01:54:07',3,1,2,1,1,3,0,52,1),(87,'MegaChompy by Yoyi',445,252,140,52,NULL,60,4,722,11,24,337,89,157,182,'Logra:\r\nVive Dragon Claw de un Garchomp con Life Orb y mata de vuelta con el propio.\r\nVive HP Ice de Mega Manectric\r\nVive con 87.5% de probabilidad un Moonblast de Gardevoir +252.\r\nGana 1 vs 1 contra Mega Kangaskhan, independiente del EV spread que tenga.\r\nVive un 62.5% de las veces un Ice Beam de Politoed/Ludicolo +252.\r\n\r\nAdemás, al Mega Evolucionar permite:\r\n\r\nOHKO a 252 HP Mega Mawile en arena, y 6,3% de hacerlo sin arena lo que permitía matarlo con la ayuda de algún compañero.\r\nOHKO a 4HP Mega Manectric sin arena, estando intimidado tiene un 25% de darle OHKO, y si está intimidado y con arena le hace OHKO. (Sin intimidar y con arena activando la Sand Force, el daño máximo es de 202,7%, es decir, lo mata dos veces)',NULL,'2014-12-16 14:23:51','2015-03-18 13:47:21',5,3,4,1,3,5,0,50,1),(88,'Ambipom by Noe',424,4,252,NULL,NULL,NULL,252,198,16,101,251,25