ge de la reina del VGC el 56,2% de las veces.\r\nAguanta el Sludge Bomb de un M-Gengar.\r\nAguanta el Flash Cannon de un Aegislash 252 SP. Atk Modest.\r\nCapaz de hacerle un 40% de daño con Psyshock a un Amoonguss tradicional.\r\n¡Eso por ahora! ',NULL,'2014-12-18 00:14:53','2015-11-26 01:58:21',15,3,9,6,3,15,0,73,1),(108,'terrores de los mares',87,150,NULL,100,200,60,NULL,683,3,115,59,324,252,57,'Set apoyado por Mega Abomasnow por su habilidad Nevada le da PS a Dewgong por su habilidad y siempre golpearia Ventisca. Sorpresa aprende por mov.huevo para romper la Banda Focus del rival.Surf por STAB y Doble Rayo para cubrir tipos. En caso de no usar junto a Mega Abomasnow cambia Ventisca por Rayo Hielo',NULL,'2014-12-21 17:17:40','2015-03-18 13:35:18',4,0,2,2,0,4,0,76,1),(109,'BattleBunny',428,4,252,NULL,NULL,NULL,252,758,11,7,136,8,409,252,'Hola ^^ \r\nBueno aca está mi pequeña Lopunny , obviamente debe tener High Jump Kick , es el movimiento más fuerte del Mega.\r\nLuego tenemos los puños , podemos elegir entre cualquier puño , yo ocupo \"Ice punch\" por los voladores y dragones.\r\nLuego tenemos \"Drain punch\" lo ocupo para tener un poco de \"defensa\" y proteger a Loppuny de morir rápido.\r\nY por ultimo \"Fake out\" para ser molesto al salir , como cualquier chica:v\r\nY ocupenlo shiny que así es más bonito',NULL,'2014-12-24 04:30:35','2015-03-18 13:35:10',5,1,3,2,1,5,0,77,1),(110,'Serperior La bestia',497,6,NULL,NULL,252,NULL,252,274,5,126,437,202,406,237,'Hola^^\r\nYa que ahora es legal el HO de Serperior :D aquí una estrategia.\r\nBueno el PO puede ser Hielo - Roca - Fuego.\r\nEl item tambien puede ser Banda Focus por cualquier pokemon peligroso...Talonflame ¬¬\r\nNo hay mucho que explicar... Lluevehojas en vez de bajar SpA te lo subira , y la famosa \"Red Viscosa\" nos subira la velocidad :D \r\nEn sí este pokémon está roto\r\nAh y... PO y Pulso Dragón son movimientos para cubrir tipos^^\r\nEso adiós',NULL,'2014-12-24 04:53:49','2015-03-18 13:34:57',8,-6,1,7,-6,8,0,77,1),(111,'sida-senpai',663,NULL,140,NULL,192,NULL,176,247,20,177,413,315,261,269,'logra debilitar al mawille 252 HP,al rotom podadora 252 hp,le gana en velocidad al talonflame firme 252 en velocidad....proporciona un buen soporte al equipo podiendo quemar al enemigo y usar taun antes q otros usuarios como por ejemplo gengar.',NULL,'2014-12-24 20:47:39','2015-03-18 13:34:50',6,0,3,3,0,6,0,78,1),(112,'Infernape de apoyo',392,NULL,252,NULL,4,NULL,252,252,10,66,370,315,252,501,'Se corre un set mixto para evitar quedar neutralizado por intimidates enemigos, overheat sigue siendo un ataque potente que permite darle OHKO a Mega mawile standard.\r\n\r\nInfernape al ser un poke con una velocidad base de 108 permite ser mas rapido que mega kangaskhan y hacerle fake out primero.\r\n\r\nQuick guard permite ayudar al compañero a bloquear fake outs mas lentos y ataques prioritarios como los de Talonflame o Thundurus.\r\n\r\nFinalmente debido a su fragilidad casi siempre se le activará la focus sash, y en esos casos se le activará su habilidad Blaze que potenciará su Overheat.\r\n\r\n252 Atk Infernape Close Combat vs. 4 HP / 0 Def Mega Kangaskhan: 176-210 (97.2 - 116%) -- 81.3% chance to OHKO\r\n\r\n4 SpA Infernape Overheat vs. 252 HP / 4 SpD Mega Mawile: 158-188 (100.6 - 119.7%) -- guaranteed OHKO',NULL,'2014-12-28 03:07:09','2015-03-18 13:34:37',3,3,3,0,3,3,0,5,1),(113,'Punky con Chaleco (Tutores Update)',560,252,244,12,NULL,NULL,NULL,683,11,22,252,282,409,162,'A falta de creatividad y aumento de pajita para armar un spread nuevo de Scrafty Assault Vest, listo el conocido spread que soporta el Brave Bird de Talonflame Choice Band en -1 (aunque Talonflame no se vea demasiado actualmente). Lo ideal es por supuesto jugar con los EVs si se puede hallar algo mejor. Este pequeño review entonces calza en el pecado de la pereza.\r\n\r\nLo importante aquí es notar el acceso que tiene Scrafty ahora a movimientos de tutor gracias a ORAS. Knock Off es una enorme herramienta en BO3 al scoutear Items; y en todas las instancias en general, muy útil al anular Leftovers, Sitrus Berry, los Choice, y otros objetos clave. Super Fang es discutible en lugar de Ice Punch en el set estándar de VGC14, ya que Chomp va en bajada y Landorus-T en subida, el cual gracias a su Intimidate recibe daño no tan grande. Mega Salamence con su intimdate previo y excelente defensa física tampoco justifica el uso de Ice Punch.\r\n\r\nEl aumento de Pokémon Bulky e intimidates en el Metagame de VGC15 pone sobre la mesa la opción de Super Fang, ya que aún con muchos intimidates afectándolo, Scrafty puede mantenerse consistente en daño y poner en Rango de KO a los atacantes que si pueden tener presencia. Objetivos comunes pueden incluir Suicune, Zapdos, Landorus-T o Cresselia en el Switch. Los otros dos moveslots son estándares, y no creo que varíen porque Fake Out y Drain Punch tienen su mérito propio.\r\n\r\nAhora, ¿es realmente Scrafty un Pokémon óptimo para VGC15? Tal vez no, ya que aún con el Assault Vest, la ofensiva Fairy de Pixilate Hyper Voice de la mano de Sylveon y Gardevoir, que es bastante común actualmente, le resta mucho Staying Power en relación a VGC14.\r\n\r\nPero ¿será siempre así? Nuevamente, tal vez no. El metagame evoluciona constantemente y en un futuro la ofensiva de Hyper Voice quizá sea menos común. Por ahora son juguetes nuevos y llaman la atención, como en todas las cosas. Hasta que baje la novedad, Scrafty no podrá brillar, porque potencial para adaptarse a un metagame bulky y cada vez más físico, tiene.',NULL,'2014-12-28 06:40:54','2015-11-26 01:58:23',5,3,4,1,3,5,0,79,1),(114,'NinjaSyao\'s Milotic',350,148,NULL,172,132,4,52,683,3,172,503,58,56,243,'Primero que todo, el spread no es mío. Es del usuario de Nugget Bridge NinjaSyao, conocido por ser muy bueno elaborando y optimizando Spreads. Lo comparto porque es básicamente de acceso público por ser un foro y es muy sexy para no probarlo.\r\n\r\n(Pueden ver el original en el siguiente link: http://nuggetbridge.com/forums/topic/11227-milotic-ev-spread/ )\r\n\r\n- Le da OHKO al Chomp 12HP/36SpDef con Ice Beam, popularizado en los últimos meses de vida de VGC14.\r\n- A Landorus-T no AV y Mence-MegaMence igual. En este caso es más fácil por el intimidate que activa Competitive\r\n- Outspeedea a los Rotom bulky\r\n- Si puede recibir Giga Drain de Ludicolo o Thunderbolt de Rotom, los pulveriza de vuelta con algo de predicción de la mano de Mirror Coat\r\n- Tiene buen chance de sobrevivir Double Edge de la MILF favorita del año 2014, solo para mostrar su bulk físico. 18.8% chance de OHKO\r\n- Sobrevive siempre el Leaf Storm de Mega Sceptile Modest\r\n- Jolly LO Chomp\'s Earthquake tiene 15.6% chance de dar un 2HKO.\r\n- Modest 252 Rotom tiene 8.6% chance de 2HKO\r\n- Puede sobrevivir siempre un Dark Pulse + Draco Meteor de un Hydreigon Specs. Ese Bulk especial es insano.',NULL,'2014-12-28 07:42:39','2015-03-18 13:34:07',5,1,3,2,1,5,0,80,1),(115,'FRIKI\'s Salamence',373,196,8,52,NULL,NULL,252,174,10,22,349,126,337,355,'Salamence pseudo bulk cual única función es matar al M-Mawile de Rizzo (por ende cuando me refiera a M-Mawile será con el spread de Rizzo) y sobrevivir otros dragones. Se vale de su habilidad y Dragon Dance. Este Mence lo que hace es:\r\n-Sobrevive Play Rough + Sucker Punch de M-Mawile a -1 y lo mata con dos Fire Blast en Sol\r\n-37.5% de matar a un M-Mawile 252 HP / 0 SDef con Fire Blast en Sol (pero éste te mata de vuelta de Play Rough)\r\n-Sobrevive Outrage +0 Adamant Garchomp Life Orb y lo mata de Dragon Claw post Dragon Dance\r\n-Aguanta Draco Meteor de Hydreigon Modest Choice Scarf y lo mata de Dragon Claw post Dragon Dance\r\n-Se aplica lo mismo que lo anterior para todos los dragones\r\n\r\nComo vemos no hace una labor excepcional, nada que otro Salamence no haga, solo radica en que este mata un 100% de las veces al Mawile de Rizzo.\r\n\r\nY lo último, el cuarto slot puede variar, moves útiles son Rock Tomb o Protect.\r\n\r\n',NULL,'2014-12-31 20:20:51','2015-03-18 13:33:52',5,-3,1,4,-3,5,0,81,1),(116,'FRIKI\'s M-Salamence',373,252,196,16,NULL,44,NULL,759,11,22,349,38,182,89,'Hola, vengo con otro Salamence, y éste es también bulk, pero la gracia... Es que es mega!\r\nY lo que hace:\r\n\r\n-Resiste Ice Beam Ludicolo/Politoed Modest 252 y los mata de vuelta con Double Edge +0\r\n-Mata de Double Edge a Hydreigon (hay que inmovilizarlo primero, Fake Out es una opción)\r\n-Gana siempre 1 vs 1 contra cualquier Garchomp/M-Kangaskhan/Talonflame\r\n-Aguanta Ice Shard de Mamoswine Adamant 252 con Life Orb y lo mata con Double Edge\r\n-Aguanta el HP Ice de M-Manectric pero NO lo alcanza a matar de EQ\r\n-Resiste HP Ice de Timid Thundurus (Life Orb) el 50% de las veces\r\n-Heatran Modest 252 no lo mata de HP Ice\r\n-Resiste Rock Slide y Stone Edge (este a -1) de Adamant Life Orb Terrakion y lo mata de vuelta\r\n\r\nToma muchas más cosas pero deben estar a -1, los cálculos los hice +0 así que resiste gran cantidad de ataques, y el EQ puede ambiar por Rock Slide, es optativo, al igual que Protect por Roost\r\n',NULL,'2014-12-31 20:46:55','2015-03-18 13:33:36',7,-5,1,6,-5,7,0,81,1),(117,'Hongo Pesado',286,4,252,NULL,NULL,NULL,252,249,11,90,147,164,182,264,'',NULL,'2015-01-03 01:56:34','2015-03-18 13:33:25',4,-2,1,3,-2,4,0,82,1),(118,'Regi-rock',377,252,52,100,NULL,100,NULL,211,11,29,89,444,446,182,'Regirock es un pokemon  sumamente defensivo y con los EVs en PS al máximo aguantara casi cualquier ataque, Stone edge recibe stab, earthqake para cobertura, protect para recuperas PS con restos.',NULL,'2015-01-03 03:46:36','2015-03-18 13:33:14',6,-4,1,5,-4,6,0,83,1),(119,'Anti ‘15',589,252,252,NULL,NULL,NULL,NULL,252,21,142,224,529,442,182,'Un buen counter del lead Ludicolo + Politoed, peligro de gran parte de los setters de TR y un dios dentro del mismo, counter de Cresselia, Sylveon, Gardevoir, Gothitelle y gracias a los tutores, hasta del mismisimo Heatran, aguantando su Heat Wave con Focus Sash y devolviendole un Drill Run con un poco mas de 80% de probabilidad de hacerle OHKO al estandar 252hp/252sp.a, además Overcoat le permite ignorar los polvos de los molestos Amoonguss, Venusaur y demás.',NULL,'2015-01-06 00:27:47','2015-11-27 03:44:42',6,2,4,2,2,6,0,20,1),(120,'Bichito',637,52,NULL,NULL,252,NULL,200,252,3,68,483,405,182,324,'La estrategia se basa en utilizar un Quiver Dance, por consiguiente subiendose el Ataque Especial. La idea es que nos bajen la vida hasta el punto en el que se active nuestra habilidad \"Enjambre\" y para tener precaución de ser debilitado por un 1HKO nos equiparemos con la banda focus. Luego solo basta con \"spammear\" Bugg Buzz o Signal Beam, uno de ellos pueden, claramente, ser sustituidos por algun ataque de fuego como podría ser Heat Wave o Fiery Dance.',NULL,'2015-01-06 04:35:31','2015-03-18 13:33:03',4,-2,1,3,-2,4,0,43,1),(121,'Super Sweeper',277,4,252,NULL,NULL,NULL,252,250,11,62,263,182,413,98,'Set en teoría standar. Mata casi todo con Imagen que gracias a la quemadura + la habilidad lo hacen un ataque incluso más potente que Brave Bird y sin recoil, se incluye igual Brave Bird en caso de quedar 1vs1 contra algún fantasma, y Ataque Rápido en caso de estar ante algo más rápido que nosotros, como Mega Manetric.',NULL,'2015-01-09 00:35:40','2015-11-26 01:58:25',5,3,4,1,3,5,0,82,1),(122,'OneUp',591,NULL,NULL,252,4,252,NULL,258,24,144,182,476,202,147,'Al ser un pokemon con una base muy alta en vida, intentamos potenciar mas las dos defensas para asi poder aguantar todo tipo de atacantes. La naturaleza tambien puede ser Bold(Osada) para sufrir menos daño de los posibles contoneos, pero al ser un pokemon con muchos ataques de estado no suele recibirlos, por eso preferimos bajarle la velocidad, asi ganamos ventaja ante posibles Trick-roomers.',NULL,'2015-01-10 14:26:23','2015-07-08 18:14:40',3,-1,1,2,-1,3,0,86,1),(123,'Quetzalcóatl',497,4,NULL,252,NULL,252,NULL,211,3,126,182,73,437,406,'Al tener la habilidad de respondon este pokemon puede ir hinchandose gradualmente por lo tanto podemos optar por una mejora defensiva en cuanto a los EVs, que mezclado a restos, drenadoras y proteccion nos daran un aguante mas duradero mientras avanza el combate.\r\nPodemos sustituir restos por Coba Berry (Baya Kouba) para asi poder aguantar un Pajaro osado de un talonflame.\r\nOtro cambio admisible seria cambiar pulso dragon por PO tipo roca, que mezclado con la baya nos hara quitarnos de encima a ese talonflame sin ningun problema.\r\nSi queremos ser mas ofensivos, otra opcion seria cambiar las drenadoras por gigadrenado, que hace mas daño y tambien nos cura.',NULL,'2015-01-10 14:47:22','2015-03-18 13:32:26',3,1,2,1,1,3,0,86,1),(124,'Estandar Anti-Thundurus',547,252,NULL,NULL,NULL,NULL,252,252,5,158,366,269,270,227,'El Taunt mas rápido del juego sin contar velocidad base. Hecho sólo para hacer taunt a Thundurus,settear TW y atrapar en protect o boosteos al rival. Helping Hand siempre es útil.',NULL,'2015-01-12 06:28:37','2015-03-18 13:32:19',2,0,1,1,0,2,0,20,1),(125,'Anti Garchomp-Landorus-Spamflame-Etc.',407,76,NULL,136,168,128,NULL,258,3,101,311,182,237,390,'¡La perfecta ayuda para un equipo tormenta de arena esta aquí!, el movimiento meteorobola de Roserade será suficiente para deshacernos de las debilidades de ella misma y de otros pokémon molestos como Talonflame, Thundurus, Zapdos y todo peligro con alas; y por su puesto, de aún más ayuda, el movimiento Poder Oculto, que en este caso será el de Hielo, que, junto con la habilidad Experto se verá potenciado y será de mucha utilidad para eliminar rápidamente a pokémon aún más molestos, como lo son Ammongus, Garchomp, Landorus y las mismas cosas típicas que vemos en el VGC actual, y para más aún, molestamos a nuestro enemigo con estas infernales púas tóxicas, que si son bien usadas, dejarán al oponente con más de un dolor de cabeza.\r\n\r\n¡Espero les haya ayudado!, ¡Suerte en la competencia, entrenadores!',NULL,'2015-01-14 05:49:17','2015-03-18 13:32:05',3,-1,1,2,-1,3,0,82,1),(126,'Seto\'s Pelipper',279,252,NULL,156,NULL,100,NULL,135,2,44,503,355,366,469,'252+ SpA M-Salamence Draco Meteor vs. 252 HP / 100 SpD Pelipper: 135-159 (80.8 - 95.2%) -- guaranteed 2HKO\r\n252+ SpA Aerilate Salamence Hyper Voice vs. 252 HP / 100 SpD Pelipper: 91-108 (54.4 - 64.6%) -- guaranteed 2HKO\r\n252+ Atk Aerilate Salamence Return vs. 252 HP / 156+ Def Pelipper: 106-126 (63.4 - 75.4%) -- guaranteed 2HKO\r\n252+ Atk Tough Claws M-Metagross Zen Headbutt vs. 252 HP / 156+ Def Pelipper: 84-100 (50.2 - 59.8%) -- guaranteed 2HKO\r\n252+ Atk Landorus-T Rock Slide vs. 252 HP / 156+ Def Pelipper: 60-72 (35.9 - 43.1%) -- guaranteed 3HKO\r\n252 Atk Parental Bond Mega Kangaskhan Return vs. 252 HP / 156+ Def Pelipper: 100-118 (59.8 - 70.6%) -- guaranteed 2HKO\r\n252+ Atk Huge Power Mega Mawile Play Rough vs. 252 HP / 156+ Def Pelipper: 114-135 (68.2 - 80.8%) -- guaranteed 2HKO\r\n\r\nScald con probabilidad de quemar con buen Hax, Roost para aumentar durabilidad, puede ser cambiado con otro ataque que se estime más conveniente dependiendo del team\r\nWide Guard ayuda a combatir el Hyper Voice Spam, Rock Slide, etc\r\n\r\nRain Dish a pesar de que no siempre estará en lluvia es mejor que su otra habilidad.',NULL,'2015-01-14 22:04:50','2015-07-08 18:14:19',2,0,1,1,0,2,0,88,1),(127,'Ponzoña mortal',335,6,252,NULL,NULL,NULL,252,249,11,137,263,370,8,182,'La habilidad Toxic Boos (Impetú tóxico) sube el ataque físico de Zangoose en un 50% cuando está envenenado, lo que equivale a decir que su ataque base de 115, sube a 172, lo cual ya lo hace una amenaza importante. Protect es necesario el primer turno para garantizar el envenenamiento auto infligido.\r\n\r\nSu movimiento estrella es Facade, que al estar afectado por estado, duplica su fuerza. Con ello se logra el siguiente daño:\r\n101.6 - 120.2% - OHKO contra el Garchomp estándar\r\n116.6 - 138% - OHKO contra Hydreigon con 4 HP y 0 Def.\r\n61.7% - 73.8% - 2HKO contra Mega Audino con 100 HP y 156 Def.\r\n119.8 - 141.4% - OHKO contra el Mega Kangaskhan estándar\r\n75.1% - 88.5% - 2HKO contra Bulky Gyarados con 248 HP y 252 Def.\r\n\r\nClose Combat, usado para todo aquello que resiste al tipo normal:\r\n134.5 - 158.3% - OHKO contra Hydreigon con 4 HP y 0 Def.\r\n141 - 168.1% - OHKO contra Mega Tyranitar con 252 HP y 0 Def.\r\n\r\nIce Punch, para cobertura principalmente contra dragones:\r\n146.4 - 172.6% - OHKO contra el Garchomp estándar\r\n103.4% - 123.3% - OHKO contra Mega Salamence con 248HP\r\n116.3% - 138.7%  - OHKO contra Mega Garchomp con 100HP\r\n\r\nPrincipales amenazas:\r\nZangoose a pesar de su potencial ofensivo, se usa poco debido a su fragilidad y relativa baja velocidad. No es capaz de sobrevivir por sí mismo los ataques más comunes como el Earthquake de Garchomp o el Return de Mega Salamence. Este set necesita el apoyo de un compañero con Wide Guard o Follow Me para   poder ser aprovechado correctamente. Aún así, es bloqueado fácilmente por Aegislash que es inmune a dos de sus ataques y resiste hielo. Las otras grandes amenazas son Mega Mawile, que en su set estándar  recibe 54.1% - 64.3% de daño con Close Combat, y Mega Metagross que sin EVs en HP o defensa, apenas sufre 46.7% - 55.7% de daño con el mismo ataque.',NULL,'2015-01-15 15:35:14','2015-03-18 13:31:33',2,2,2,0,2,2,0,85,1),(128,'Mokona Anti Bromistas',547,132,NULL,NULL,152,NULL,224,252,5,158,202,585,269,366,'El bromista mas rápido del VGC, superando por un punto al molestoso Thundurus para mofarlo antes que lo haga él, luego poder setear viento a fin para ayudar a tu equipo, los otros ataques es por si te lanzan algún bromista scarf (si, existen) y no quedar totalmente inutil, la focus sash es para resistir un turno mas en caso de que aparezca un talonflame jolly ya que a el no lo superamos, pero si al adamant por 2 puntos, en la parte ofensiva/defensiva logra vencer a gastrodom y M-swamper en un 1vs1.\r\nMoonblast es para dañar antes que terminen de matarlo y/o para matar algunos dragones.\r\nSon libres de modificarlo para mejor\r\nRegistrado por CokeSebas/Makise  ♥',NULL,'2015-01-19 16:26:38','2015-11-26 01:58:31',5,3,4,1,3,5,0,21,1),(129,'Mega Sableye, el staller definitivo',302,252,NULL,148,NULL,108,NULL,746,2,158,261,347,247,105,'Mega sableye es un gran pokémon para tanquear, posee 3 inmunidades y solo una debilidad, mega kangaskhan no lo puede tocar, y gracias a su habilidad nos podemos despreocupar de los taunts, encores, disables, dark void y un sin fin de ataques molestos, lo ideal es tenerlo en el equipo junto a otro pokémon capaz de mega evolucionar, ya que como muy poca gente se espera un mega sableye, en el primer turno nuestros oponentes pueden realizar un movimiento que se les refleje gracias a magic bounce, por ejemplo un dark void o un taunt enemigo\r\n\r\nPara lograr ganar con mega sableye es necesario previamente eliminar sus amenazas, las cuales son pokémon tipo hada como mega mawile y sylveon y atacantes fisicos de fuego como talonflame (ya que no los podemos quemar), entre otras amenazas menos frecuentes tenemos a los pokémon con Guts y Mega Loppuny\r\n\r\nUna vez que tenemos controladas las posibles amenazas basta hacer uno o dos calm mind para que los ataques especiales oponentes nos hagan un daño minimo, mientras que a los atacantes fisicos los debemos quemar, despues de eso podemos rematar con shadow ball o recuperarnos energia para que las quemaduras eliminen naturalmente a nuestros oponentes, se elige shadow ball sobre dark pulse ya que el primero le pega neutro a los tipo hada\r\n\r\nEn torneos sancionados hay que tener cuidado de abusar de los calm mind y recover ya que puede que el tiempo se nos acabe y perdamos automaticamente\r\n\r\nEl spread esta hecho para hacerlo balanceado y aguantar de mejor manera a sus amenazas mas frecuentes, lo ideal es tenerlo acompañado de compañeros que puedan deshacerse de sus amenazas, por lo que el spread permite aguantar por lo menos un golpe de estos\r\n\r\nContra mega mawile el calculo se realiza bajo la suposición que lo quemamos con nuestro will o wisp prioritario ya que de otro modo es imposible aguantar el play rough\r\n252+ Atk Huge Power burned Mega Mawile Play Rough vs. 252 HP / 148+ Def Mega Sableye: 97-115 (61.7 - 73.2%) -- guaranteed 2HKO\r\n\r\nContra Sylveon es necesario el calm mind para aguantar un hyper voice choice specs\r\n252+ SpA Choice Specs Pixilate Sylveon Hyper Voice vs. +1 252 HP / 108 SpD Mega Sableye: 116-140 (73.8 - 89.1%) -- guaranteed 2HKO\r\n\r\nContra Talonflame no hay mucho que podamos hacer mas que recuperarnos para que se mate él solo, gracias al recoil de sus movimientos\r\n252+ Atk Life Orb Talonflame Brave Bird vs. 252 HP / 148+ Def Mega Sableye: 71-86 (45.2 - 54.7%) -- 49.6% chance to 2HKO\r\n\r\nOtro pokémon que da problemas es los Mega Charizard, ya que el overheat de Zard Y bajo sol es capaz de dar OHKO a nuestro mega, es necesario un calm mind para aguantarlo, Zard X no se puede quemar por lo que también da problemas\r\n252+ SpA Mega Charizard Y Overheat vs. +1 252 HP / 108 SpD Mega Sableye in Sun: 115-136 (73.2 - 86.6%) -- guaranteed 2HKO\r\n252+ Atk Tough Claws Mega Charizard X Flare Blitz vs. 252 HP / 148+ Def Mega Sableye: 102-120 (64.9 - 76.4%) -- guaranteed 2HKO\r\n\r\nContra el resto de los \"heavy hitters\" del meta, ninguno es capaz de darle un OHKO por lo que si sabemos manejar los recover y calm mind/will o wisp es cuestión de tiempo para que nuestros oponentes caigan\r\n\r\n252+ Atk Life Orb Landorus-T Earthquake vs. 252 HP / 148+ Def Mega Sableye: 66-78 (42 - 49.6%) -- guaranteed 3HKO\r\n\r\n252 Atk Aerilate Mega Salamence Double-Edge vs. 252 HP / 148+ Def Mega Sableye: 97-115 (61.7 - 73.2%) -- guaranteed 2HKO\r\n252 Atk Aerilate burned Mega Salamence Double-Edge vs. 252 HP / 148+ Def Mega Sableye: 48-57 (30.5 - 36.3%) -- 60.9% chance to 3HKO\r\n\r\n252+ SpA Choice Specs Hydreigon Dark Pulse vs. 252 HP / 108 SpD Mega Sableye: 88-105 (56 - 66.8%) -- guaranteed 2HKO\r\n252+ SpA Choice Specs Hydreigon Dark Pulse vs. +1 252 HP / 108 SpD Mega Sableye: 58-70 (36.9 - 44.5%) -- guaranteed 3HKO\r\n\r\nOfensivamente lo unico rescatable es que debido a su baja velocidad, con un calm mind es capaz de darle OHKO a aegislash en forma espada\r\n+1 0 SpA Mega Sableye Shadow Ball vs. 252 HP / 4 SpD Aegislash-Blade: 200-236 (119.7 - 141.3%) -- guaranteed OHKO',NULL,'2015-01-21 22:43:27','2015-11-26 01:57:59',7,5,6,1,5,7,0,5,1),(130,'Sapolio~ (Pephan TR Landorus-T)',729,124,132,NULL,NULL,252,NULL,683,21,22,276,89,157,282,'Mi Landorus T personal, adaptado para el TR que de vez en cuando uso.\r\nPasó de ser el típico Choice Scarf flan a ser un pokemon con gran poder de ataque, variedad de moves y un bulk sorpresivo e impensado.\r\nGracias al Chaleco de Asalto y la Intimidación este pokemon reduce el daño de forma impensada a ambos pokes del rival.\r\nEl Spread está diseñado para alcanzar el ataque máximo de un pokemon de base 130, 252 adamant, y el bulk permite aguantar el 99,9% de los Hidden Power Ice, siendo derrotado sólo por el Hidden Power ice de Chandelure specs (si, a ese nivel)\r\nPuede resistir la mayoría de los ice beam sin stab, como el de ludicolo 252 Modest Life Orb, y puede resistir 2 o 3 vozarrones de sylveon dependiendo de su spread. También puede resistir sin problema alguno el heat wave de Charizard Y en sol y no tiene grandes problemas con mega Kangaskhan, haciendo de este un golpeador letal y resistente',NULL,'2015-01-21 23:09:55','2015-11-26 16:18:03',5,-1,2,3,-1,5,0,49,1),(131,'Pephan Togekiss',468,200,NULL,172,4,40,92,135,5,32,403,266,396,366,'Un Soporte útil con buena capacidad ofensiva. La velocidad supera por un punto al máximo de bisharp adamant y darle KO con esfera aural. Las defensas y Hp casi para soportar cualquier golpe super efectivo, o aguantar varios golpes x1. La sitrus para un segundo aire, y tajo aéreo para aumentar el Hax.\r\nTambién se puede usar con Afortunado y Brillo mágico si se desea un movimiento de campo.\r\nOpté por timid como naturaleza por el hecho de que si usaba otra gastaba muchos evs en velocidad y perdía bulk',NULL,'2015-01-23 02:59:12','2015-07-08 18:14:00',6,0,3,3,0,6,0,49,1),(132,'Medicham-Planti',308,84,132,252,NULL,NULL,40,704,11,37,182,8,409,428,'Es un pokemon con un buena presencia ofensiva , haciendo un daño considerable a varios pokemon, y siendo el counter de Mega Kangaskhan,Landorus-T,Garchompy una serie de atacantes físicos sin ataques Super-efectivos a Medicham al no hacerñe OHKO....No es un pokemon que funcione solo , necesita un equipo que sepa cubrirlo y hacerlo funcionar de la manera mas apropiada ',NULL,'2015-01-23 03:17:40','2015-03-18 13:29:13',4,0,2,2,0,4,0,94,1),(133,'Sarmi\'s Serperior',497,252,NULL,252,NULL,4,NULL,683,2,126,243,406,202,437,'Chaleco asalto potencia defensa esp. en un 50%, la repartición de EV\'s y la naturaleza potencias la salud y defensa, haciendo de superior bastante resistente, con lluevehojas duplica su ataque especial por su habilidad respondón y con manto espejo devolveremos el daño x 2 a pokes que nos quieran bajar con ataques tipo fuego y volador entre otros. gigadrenado para hacer gran daño y curarse a a vez. y pulso dragón para algo de cobertura (puede cambiarse manto espejo por HP fuego para bajar pokes como ferrothorn o HP roca para pokes fuego o volador) ',NULL,'2015-01-26 19:39:37','2015-03-18 13:31:06',3,-1,1,2,-1,3,0,63,1),(134,'Anti todo',658,NULL,252,NULL,4,NULL,252,247,10,168,441,67,58,182,'Gracias a su gran velocidad Greninja logra outspeedear a casi todo el meta y darle OHKO a gran parte de los pokes populares de vgc15, se usa ice beam en lugar de ice punch para evitar ser intimidados y porque aun sin mucho EV logra dar OHKO.\r\nObviamente greninja no posee las mejores defensas por lo que tenemos que acompañarlo de un buen compañero que ayude a que permanezca mas tiempo en juego\r\n\r\nLow kick:\r\n252 Atk Life Orb Protean Greninja Low Kick (100 BP) vs. 4 HP / 0 Def Mega Kangaskhan: 179-213 (98.8 - 117.6%) -- 93.8% chance to OHKO\r\n252 Atk Life Orb Protean Greninja Low Kick (80 BP) vs. 4 HP / 0 Def Bisharp: 296-348 (209.9 - 246.8%) -- guaranteed OHKO\r\n252 Atk Life Orb Protean Greninja Low Kick (120 BP) vs. 252 HP / 0 Def Heatran: 205-244 (103.5 - 123.2%) -- guaranteed OHKO\r\n252 Atk Life Orb Protean Greninja Low Kick (120 BP) vs. 4 HP / 0 Def Terrakion: 237-281 (141.9 - 168.2%) -- guaranteed OHKO\r\n252 Atk Life Orb Protean Greninja Low Kick (120 BP) vs. 252 HP / 0 Def Mamoswine: 260-307 (119.8 - 141.4%) -- guaranteed OHKO\r\n252 Atk Life Orb Protean Greninja Low Kick (100 BP) vs. 252 HP / 0 Def Hydreigon: 198-234 (99.4 - 117.5%) -- 87.5% chance to OHKO\r\n\r\nGunk Shot:\r\n252 Atk Life Orb Protean Greninja Gunk Shot vs. 252 HP / 0 Def Sylveon: 307-361 (151.9 - 178.7%) -- guaranteed OHKO\r\n252 Atk Life Orb Protean Greninja Gunk Shot vs. 252 HP / 0 Def Ludicolo: 289-343 (154.5 - 183.4%) -- guaranteed OHKO\r\n252 Atk Life Orb Protean Greninja Gunk Shot vs. 252 HP / 0 Def Azumarill: 260-307 (125.6 - 148.3%) -- guaranteed OHKO\r\n\r\nIce beam:\r\n4 SpA Life Orb Protean Greninja Ice Beam vs. 252 HP / 0 SpD Mega Salamence: 302-359 (149.5 - 177.7%) -- guaranteed OHKO\r\n4 SpA Life Orb Protean Greninja Ice Beam vs. 252 HP / 0 SpD Assault Vest Landorus-T: 218-265 (111.2 - 135.2%) -- guaranteed OHKO\r\n4 SpA Life Orb Protean Greninja Ice Beam vs. 4 HP / 0 SpD Thundurus: 166-198 (107 - 127.7%) -- guaranteed OHKO',NULL,'2015-01-28 23:02:18','2015-03-18 23:28:13',4,-2,1,3,-2,4,0,5,1),(135,'Firewall',59,252,NULL,NULL,252,NULL,6,211,2,22,315,555,261,270,'Un set defensivo para soporte. Arcanine es todo en uno:\r\n\r\nIntimida y aplica Will-o-wisp (Fuego Fatuo) para mermar a los atacantes físicos y usa Snarl (Alarido ) contra los atacantes especiales. Además aprovecha Helping Hand (Refuerzo) para apoyar a su compañero. Si baja el ataque oponente y ayuda subir al del compañero, ¿qué más se puede pedir? Además lleva Overheat (Sofoco) que siempre golpea duro a los rivales, aunque claro está, este set no está diseñado para atacar, sino para defender. Sin embargo, como todo poke, demos cuidarlo de algunas amenazas serias como el Scald (Escaldar) de Greninja o de Milotic con habilidad Competitive (Tenacidad).\r\n\r\nCálculos defensivos con el drop de intimidate:\r\n-1 252 Atk Life Orb Garchomp Earthquake vs. 252 HP / 0+ Def Arcanine: 120-143 (60.9 - 72.5%) -- guaranteed 2HKO\r\n-1 180+ Atk Huge Power Mega Mawile Sucker Punch vs. 252 HP / 0+ Def Arcanine: 60-71 (30.4 - 36%) -- 44.9% chance to 3HKO\r\n-1 252+ Atk Gyarados Waterfall vs. 252 HP / 0+ Def Arcanine: 108-128 (54.8 - 64.9%) -- guaranteed 2HKO\r\n-1 252+ Atk Mega Swampert Waterfall vs. 252 HP / 0+ Def Arcanine: 122-146 (61.9 - 74.1%) -- guaranteed 2HKO (sin lluvia)\r\n-1 252+ Atk Mega Swampert Waterfall vs. 252 HP / 0+ Def Arcanine in Rain: 186-218 (94.4 - 110.6%) -- 62.5% chance to OHKO (bajo la lluvia)\r\n252 SpA Vaporeon Scald vs. 252 HP / 0 SpD Arcanine: 150-176 (76.1 - 89.3%) -- guaranteed 2HKO\r\n60 SpA Rotom-W Hydro Pump vs. 252 HP / 0 SpD Arcanine: 168-198 (85.2 - 100.5%) -- 6.3% chance to OHKO\r\n112 SpA Suicune Scald vs. 252 HP / 0 SpD Arcanine: 114-134 (57.8 - 68%) -- guaranteed 2HKO\r\n\r\nCálculos ofensivos:\r\n252 SpA Arcanine Overheat vs. 252 HP / 36 SpD Mega Mawile: 186-222 (118.4 - 141.4%) -- guaranteed OHKO\r\n252 SpA Arcanine Overheat vs. 46 HP / 0 SpD Mega Sceptile: 106-126 (70.1 - 83.4%) -- guaranteed 2HKO\r\n252 SpA Arcanine Overheat vs. 252 HP / 0 SpD Thick Fat Mega Venusaur: 84-98 (44.9 - 52.4%) -- 18% chance to 2HKO\r\n\r\nOpciones:\r\nBajo el sol y para evitar el drop en ataque especial, puede usarse Heat Wave (Onda Ígnea). \r\nVarios items pueden usarse en este set sin afectar el rendimiento seriamente: \r\n- Rocky Helmet  (Casco Dentado) para dañar a los atacantes físicos.\r\n- Passho Berry (Baya Pasio) o Shuca Berry (Baya Acardo) para debilitar ataques tipo agua o tierra respectivamente.\r\n- White Herb (Hierba blanca) es una artimaña que podemos aplicar si queremos un segundo Overheat sin el drop en ataque especial.\r\n',NULL,'2015-02-10 22:23:23','2015-03-25 20:31:18',4,2,3,1,2,4,0,85,1),(136,'PowerPom',424,4,252,NULL,NULL,NULL,252,228,11,101,252,387,NULL,NULL,'Un set tal vez simple pero poderoso de este makako, primero sorpresa golpeando bastante fuerte y flincheando lo que nos puede joder y rematando con la buena velocidad que aunque no es la maxima de el igual sirve para outspedear a muchos y casi todos caen con una ultima baza.',NULL,'2015-02-11 20:38:42','2015-11-26 16:17:44',6,4,5,1,4,6,0,100,1),(137,'El Borracho',254,4,NULL,NULL,252,NULL,252,745,5,65,219,197,437,406,'Básicamente counter del clásico Thundurus (sin HP Ice), con Safeguard limita el uso de Swagger y con su habilidad detiene los ataques electricos. Con un poderoso STAB que mete miedo a Gastrodon y Rotom-W y Dragon Pulse que si bien no hace 1HKO a un par de dragones hace algo de daño. Por qué no Draco Meteor? Porque tener los únicos dos ataques de daño y que ambos te bajen -2 a SAtk es muy arriesgado. No gana 1vs1 contra los megas más usados y es presa de Talonflame; por lo cual es un mega situacional y controlador de amenazas específicas.',NULL,'2015-02-13 17:48:04','2015-03-18 18:54:05',2,0,1,1,0,2,0,81,1),(138,'Nidoking mix ',34,NULL,44,NULL,252,NULL,212,264,20,125,414,398,58,85,'Este nidoking outspedea a mega sceptile timid y con ese atk puede darle OHKO a sylveon 252 hp 0 def, virizion, gardevoir y otros threads. Thunderbolt es un move filler que puede ser reemplazado por fire blast, flamethrower u otros atk-',NULL,'2015-03-05 04:58:38','2015-11-27 03:44:57',4,2,3,1,2,4,0,103,1),(139,'Electri Kick',466,5,100,100,104,100,100,219,20,78,8,416,528,87,'Mi primer Pokemon competitivo :3 \r\nOpinen constructiva mente que le quito/pongo :3',NULL,'2015-03-09 20:20:09','2015-11-26 16:16:12',11,-11,0,11,-11,11,0,104,1),(140,'Hitmontop Support Ofensivo',237,252,136,60,NULL,60,NULL,135,11,22,252,370,469,364,'Un set visto varias veces en Hitmontop,puede aguantar varias cosas tanto el lado físico (Por la intimidación) y por el especial, ya que su defensa especial es lo que más destaca.\r\n\r\nLa Baya Zidra se le puede cambiar por la Baya Ziuela.\r\n\r\nA Bocajarro por Stab y porque puede destrozar varias cosas (Aunque no le asegura al 100% el OHKO a Mega Kangha,aunque le deja bastante débil)\r\n\r\nVastaguardia por que este VGC esta lleno de Vozarrones,Ondas ígneas,Avalanchas,Terremotos,etc.También se le puede remplazar por Anticipo.\r\n\r\nAmago para romper protecciones y muchas cosas más,además que tiene prioridad.',NULL,'2015-03-18 06:50:31','2015-07-08 18:12:57',1,1,1,0,1,1,0,109,1),(141,'Bluffing Lando',729,156,252,4,NULL,4,92,245,11,22,89,157,276,182,'Un gran problema que tiene Landorus therian, es que no es capaz por si solo de hacerle un OHKO a M-Kangaskhan, es por esto que se usa expert belt para asegurar este golpe\r\n\r\n252+ Atk Expert Belt Landorus-T Superpower vs. 4 HP / 0 Def Mega Kangaskhan: 197-233 (108.8 - 128.7%) -- guaranteed OHKO\r\n\r\nSe prefiere expert belt por sobre Life Orb ya que este ultimo revela inmediatamente el objeto que tenemos, por lo que al usar Expert Belt podemos hacer un bluff que tenemos Assault Vest y luego hacer protect cuando el oponente no se lo espere, o incluso si el equipo oponente es mas lento podemos bluffear una choice scarf, tiene la speed suficiente para ganarle en speed al bisharp adamant por un punto, y los EVs en hp y def le permiten aguantar siempre un +1 252+ Sucker Punch de Bisharp',NULL,'2015-03-18 12:54:25','2015-05-01 01:58:40',3,-1,1,2,-1,3,0,5,1),(142,'Frozen B@%*',478,NULL,NULL,NULL,25,NULL,252,244,5,130,85,247,58,324,'',NULL,'2015-03-18 13:28:13','2015-07-08 18:12:44',2,2,2,0,2,2,0,110,1),(143,'Ponkachu\'s Sylveon',700,148,NULL,100,252,NULL,8,176,3,182,237,304,473,182,'Este Sylveon esta eveado para aguantar hasta un Iron Head de M-Mawile +252 Atk junto con la Berry para disminuir ataques tipo acero. Hidden Power Ground para combatir sus amenzas mas recurrentes que son los acero y veneno, en especial a Heatran que lo puede dejar muy tocado (min un 60 % del hp, pensando que el antes mencionado, posee 252 en hp sin la Shuca Berry), esta enfocado en rematar, debido a su incapacidad de darle OHKO a Pokemon que pertenecen al rango de los mas usados, comparada con su version Specs. Es necesario darlo Support de Tailwind o algún Speed Controller para hacer a Sylveon una gran amenaza. Pros: Incapacidad de darle OHKO con un ataque tipo Acero sin Boost. Factor Sorpresa. Versatilidad de movimientos y no estar estancado usando un ataque como su versión Specs. Contras: Incapacidad de Outspeedear a sus mayores amenzas sin un Speed Control. No da OHKO como su versión Specs. ',NULL,'2015-03-18 19:14:39','2015-03-20 19:16:50',1,1,1,0,1,1,0,111,1),(144,'Heatranman',485,236,NULL,148,44,12,70,211,3,18,436,164,414,182,'Heatran cumplió uno de mis criterios de trabajo en equipo de tener un fuerte ataque de tipo Fuego. \r\n\r\nLa difusión EV fue diseñado para permitir Heatran para tomar un Combate Cuerpo a Cuerpo de Infernape y todavía tener suficiente HP para crear un sustituto. Esa cantidad de granel también permite Sustituto de Heatran tomar dos roca Diapositivas de una Adamant Landorus-T. 44 Sp. La inversión Ataque permite Heatran a 2HKO un Escudo-forme Aegislash con 252 HP / 4 Sp.Def, y los EVs restantes se vierten en velocidad.\r\n\r\nSin embargo, tuve que modificar la propagación EV en mi en el juego Heatran, ya que tenía 30 IVs en HP y 29 IVs en Sp.Def. La difusión fue el cambio para dar Heatran un número impar de su valor de HP para tener mejor Súper Colmillos y crear suplente.',NULL,'2015-03-28 01:08:07','2015-11-26 16:15:51',2,-2,0,2,-2,2,0,98,1),(145,'Cybertron\'s Cresselia',488,220,NULL,100,188,NULL,NULL,135,22,26,433,58,94,270,'Permite aguantar el Knock Off de un Choice Band Bisharp, el Dark Pulse de Specs Hydreigon y la Shadow Ball de LO Aegislash\r\nLos Evs en Sp.Atk son para lograr un OHKO en un 0/0 Landorus-T con Ice Beam\r\nFuente: https://www.youtube.com/watch?