uesto a Bisharp.',NULL,'2015-04-22 02:11:40','2015-04-22 02:14:42',1,1,1,0,1,1,0,111,1),(152,'Suicune el tanque',245,252,NULL,136,92,NULL,28,135,2,46,503,58,366,555,'Posee el Special Attack justo para darle OHKO a un 4/0 Landorus-T\r\n\r\nPosee la velocidad necesaria para superar a un Rotom con max 12 Ev en velocidad (y poder usar Snarl para que sus ataques electricos hagan mucho menos daño), estando bajo Tailwind su velocidad le permite superar al tipico Landorus-T adamant scarfed y a max-speed Mega Sceptile\r\n\r\nEl resto de los EVs se le dieron en bulk fisico para aguantar mejor los ataques por ese lado, especificamente los Double Edge de Jolly Mega Kangaskhan serán 3HKO\r\n\r\n252 Atk Parental Bond Mega Kangaskhan Double-Edge vs. 252 HP / 136+ Def Suicune: 108-128 (52.1 - 61.8%) -- guaranteed 3HKO after Sitrus Berry recovery',NULL,'2015-05-13 04:24:57','2015-07-08 18:11:54',1,1,1,0,1,1,0,5,1),(153,'Support Milotic',350,236,NULL,156,68,44,4,135,2,172,503,277,196,105,'Milotic especialmente diseñado para ayudar en cualquier equipo, incluso es los Trick Room cambiando Viento Hielo por Rayo Hielo u otro movimiento, excelente muralla, suportter y pokémon ofensivo. Aguanta:\r\n\r\n252+ SpA Mold Breaker Mega Ampharos Thunderbolt vs. 236 HP / 44 SpD Support Milotic: 162-192 (81.4 – 96.4%) — guaranteed 2HKO after Sitrus Berry recovery\r\n\r\n252+ SpA Mega Sceptile Energy Ball vs. 236 HP / 44 SpD Support Milotic: 146-174 (73.3 – 87.4%) — guaranteed 2HKO after Sitrus Berry recovery.\r\n\r\n252 Atk Technician Breloom Bullet Seed (3 hits) vs. 236 HP / 156+ Def Support Milotic: 180-216 (90.4 – 108.5%) — guaranteed 2HKO after Sitrus Berry recovery\r\n\r\n252+ Atk Electivire Wild Charge vs. 236 HP / 156+ Def Support Milotic: 152-180 (76.3 – 90.4%) — guaranteed 2HKO after Sitrus Berry recovery.',NULL,'2015-05-20 02:32:15','2015-11-27 03:45:04',4,2,3,1,2,4,0,82,1),(154,'Wolfey\'s Mega Gengar',94,252,NULL,44,4,28,180,695,5,26,195,247,50,182,'Gengar pensado para un equipo perish tr