Def, Puño Drenaje asesina a Mega Kanga 252 HP/ 60 Def, y Psicocorte sirve para pegar con STAB y bastante fuerte, no le hace OHKO a Ammongus, pero tiene chance de pegar crítico, no falla y además evita el daño del Casco Dentado. Detección por sobre Protección en caso de que nuestro oponente ocupe el combo Imprison + Protect.',NULL,'2015-06-25 03:42:50','2015-11-27 03:44:07',5,3,4,1,3,5,0,82,1),(163,'Cybertron\'s M-Venusaur',3,252,NULL,124,76,52,4,698,2,34,202,188,73,182,'Aguanta casi todo excepto ataques voladores como Talonflame y M-Salamence, este poke estaba en un team armado en torno a él, pueden ver el video analisis aqui: https://www.youtube.com/watch?v=1_rWXuBXLMQ',NULL,'2015-06-25 04:02:07','2015-07-13 04:55:56',2,0,1,1,0,2,0,5,1),(164,'Life Orb Landorus',729,44,132,76,NULL,NULL,252,247,11,22,89,276,157,182,'Landorus Life Orb que permite lograr el OHKO en practicamente todas las variantes de Kangaskhan. Inversión en HP y Defensa para vivir el Sucker Punch de Bisharp Adamant 252+ LO. Protect es principalmente para \"salvar\" del Fake Out al compañero, al pensar el oponente que se trata de un Landorus Choice Scarf.',NULL,'2015-06-29 01:29:26','2015-11-26 16:14:25',5,-1,2,3,-1,5,0,20,1),(165,'Charizard Buddy',142,4,252,NULL,NULL,NULL,252,252,16,127,157,366,469,241,'Un buen compañero para CharizardY. La habilidad Unnerve evita que Rotom tome su Sitrus Berry, así como Suicune, Thundurus y similares. Tailwind para Speed Control, Wide Guard protege a Charizard y a si mismo de Rock Slide, así como de Hyper Voice de Sylveon/Salamence. Sunny Day solo si está acompañado de un Charizard. Este movimiento ayuda principalmente en la \"guerra de climas\", como en la situación de un Tyranitar Mega que vuelve a activar Sand Stream luego del Drought, Politoed Scarf con Rain Dance y etc. También ayuda a recuperar el sol luego de que Politoed entre denuevo a activar la lluvia tras haber sido cambiado, y Charizard ya mega evolucionado o de plano estar en el back.',NULL,'2015-06-29 01:40:18','2015-11-27 03:45:52',5,1,3,2,1,5,0,20,1),(166,'Dunsparce sweeper ',206,4,252,252,NULL,NULL,NULL,211,11,32,355,157,137,489,'',NULL,'2015-07-13 05:02:11','2015-07-13 05:04:14',1,1,1,0,1,1,0,118,1),(167,'Maranga Milotic♥',350,236,NULL,156,100,12,4,725,2,172,503,58,105,196,'',NULL,'2015-07-22 05:29:11','2015-11-27 03:45:55',3,1,2,1,1,3,0,82,1),(168,'Life Orb Mixed Blaziken',257,NULL,52,NULL,204,NULL,252,247,20,3,182,237,315,276,'Anti-Meta Blaziken designed to beat Landorus-T, Kangaskhan, Aegislash, Amoonguss, Heatran, Salamence, Metagross.',NULL,'2015-08-13 06:10:18','2015-11-27 03:45:57',5,1,3,2,1,5,0,120,2),(169,'Belly Jet',184,196,252,28,NULL,20,12,135,11,37,182,187,453,583,'Even HP divisible by 4 to get best use of sitrus berry. Play Rough can be replaced with Return if you prefer not to miss, but you do notice the power drop sometimes.',NULL,'2015-08-13 06:13:34','2015-11-27 03:43:35',3,1,2,1,1,3,0,120,2),(170,'Trick Room Mega',282,252,NULL,4,252,NULL,NULL,696,23,36,182,433,304,94,'EV Spread here is basic, so can be adjusted as preferred. Modest is also useable as a semi-TR set. Works well alongside Scrafty, Heatran, Amoonguss.',NULL,'2015-08-13 06:17:22','2015-11-27 03:43:34',2,0,1,1,0,2,0,120,2),(171,'gastry',423,252,NULL,64,124,68,NULL,211,23,114,503,414,58,105,'Scald y earth power por STAB, Ice beam para cobertura y recover para durar mas en la batalla.\r\nOFENSIVO\r\n124+ SpA Gastrodon Ice Beam vs. 0 HP / 0 SpD Mega Salamence: 176-208 (103.5 - 122.3%) -- guaranteed OHKO \r\n124+ SpA Gastrodon Ice Beam vs. 252 HP / 0 SpD Landorus-T: 192-228 (97.9 - 116.3%) -- 93.8% chance to OHKO \r\n124+ SpA Gastrodon Earth Power vs. 252 HP / 252+ SpD Heatran: 168-204 (84.8 - 103%) -- 6.3% chance to OHKO\r\n124+ SpA Gastrodon Ice Beam vs. 252 HP / 0 SpD Thundurus: 96-114 (51.6 - 61.2%) -- guaranteed 2HKO \r\n124+ SpA Gastrodon Earth Power vs. 0 HP / 120 SpD Aegislash-Shield: 78-92 (57.7 - 68.1%) -- guaranteed 2HKO \r\n\r\nDEFENSIVO\r\n252 Atk Parental Bond Mega Kangaskhan Return vs. 252 HP / 64 Def Gastrodon: 159-189 (72.9 - 86.6%) -- guaranteed 2HKO\r\n252+ Atk Landorus-T Earthquake vs. 252 HP / 64 Def Gastrodon: 127-151 (58.2 - 69.2%) -- guaranteed 2HKO\r\n252+ SpA Choice Specs Pixilate Sylveon Hyper Voice vs. 252 HP / 68 SpD Gastrodon: 159-187 (72.9 - 85.7%) -- guaranteed 2HKO \r\n252+ SpA Aegislash-Blade Shadow Ball vs. 252 HP / 68 SpD Gastrodon: 91-108 (41.7 - 49.5%) -- guaranteed 3HKO\r\n252 SpA Aerilate Mega Salamence Hyper Voice vs. 252 HP / 68 SpD Gastrodon: 102-121 (46.7 - 55.5%) -- 71.9% chance to 2HKO\r\n252 SpA Mega Salamence Draco Meteor vs. 252 HP / 68 SpD Gastrodon: 114-135 (52.2 - 61.9%) -- guaranteed 2HKO \r\n252+ SpA Life Orb Ludicolo Giga Drain vs. 252 HP / 68 SpD Gastrodon: 312-374 (143.1 - 171.5%) -- guaranteed OHKO \r\n252+ SpA Mega Venusaur Giga Drain vs. 252 HP / 68 SpD Gastrodon: 292-348 (133.9 - 159.6%) -- guaranteed OHKO\r\n\r\nComo pueden ver Gastrodon es un pokemon que aguanta muy bien los golpes siendo solo débil al tipo planta (M-Venasaur y Ludicolo) pero teniendo dos inmunidades al tipo eléctrico y gracias a su habilidad al tipo agua, además de que da 0HKO a varias de las amenazas de del meta actual.',NULL,'2015-09-22 00:35:50','2015-11-27 03:43:19',2,0,1,1,0,2,0,124,1),(172,'Amoonguss Shyni',591,NULL,NULL,NULL,NULL,NULL,NULL,583,2,27,147,188,202,476,'',NULL,'2015-10-30 10:21:39','2015-11-27 03:43:17',2,-2,0,2,-2,2,0,126,1),(173,'greninja support',658,4,NULL,NULL,252,NULL,252,252,5,168,399,182,196,269,'La forma más rápida en la que puede ser un greninja. Mofa para sorprender a thundurus o a otro pokemon bromista, protección para cubrirse de los ataques, viento hielo para funcionar como speed controler y pulso umbrío para atacar a cresselia y aegislash y por la potencia no se deberia preocupar porque la habilidad le da stab\r\nANOTACIONES:\r\n-Debilita de dos viento hielo a landorus standar\r\n-Debilita de dos pulsos umbrio a mega metagross standar\r\n-Debilita de tres pulsos umbrios a cresselia support o trick room\r\n-Debilita de dos viento hielo a mega salamence standar y garchomp standar.\r\n-Posibiidad de debilitar a mega gengar miedoso.\r\n\r\n',NULL,'2015-11-26 01:08:30','2015-11-26 16:12:15',2,0,1,1,0,2,0,127,1),(174,'physical aegislash',681,252,36,120,NULL,100,NULL,682,21,176,14,442,425,588,'Aegislash físico, (15 ivs speed), casi siempre se podra realizar un danza espada en la partida, siendo uno de los más lentos en el juego podra hacer un buen cover en el trick room. Los ivs en velocidad y la naturaleza los hacen más lentos que un conkeldurr con fiado con 29 ivs en speed, la arma perfecta contra sylveon, en trick room sera primero y atacara antes y si no lo hay, estara en su forma escudo para resistir un bola sombra, para luego activar el seguro debilidad y rematar de un golpe.\r\nPOSIBLES resistencias:\r\n- Llamarada de un goodra chaleco asalto 252 atq. esp. modesto.\r\n- Terremoto de un landorus scarf 252 atq firme.\r\n- Bola sombra de gengar banda focus 252 atq.esp miedoso\r\n-Pulso umbrío de greninja vidaesfera 252 atq.esp miedoso',NULL,'2015-11-26 01:18:30','2015-11-27 03:46:09',2,2,2,0,2,2,0,127,1),(175,'the best dragon in the world!',706,124,NULL,156,228,NULL,NULL,683,15,157,58,188,126,276,'El mejor dragon que puede existir, la defesa especial se ve reducida por la habilidad pero aun asi es demasiado resistente con el chaleco asalto. Rayo hielo para los dragones mas comunes y para voladores, llamarada para scizor y ferrothorn. Bomba lodo para las hadas y solo por si acaso tipo planta (tambien se puede cambiar por cometa draco u otro movimiento de preferencia). Fuerza bruta para tyranitar , bisharp y kangas (habria que realizar tres de estos) tambien podria ser terremoto para los heatran.\r\nPOSIBLES resistencias :\r\n-Vozarron de sylveon specs 252 atq.esp modesto\r\n-Cometa draco de cualquier tipo dragon modesto 252 (sobretodo de hydreigon modesto con vidaesfera)\r\n-Garra dragon de garchomp 252 atq alegre\r\n-Retribucion de kangas 252 atq firme',NULL,'2015-11-26 01:32:01','2015-11-26 16:12:07',2,0,1,1,0,2,0,127,1),(176,'bromas al bromista!',302,252,NULL,40,92,124,NULL,746,23,158,182,196,399,347,'Engañamos a los bromistas para que nos hagan mofa y al megaevolucionar les rebota, viento hielo para el speed control, pulso umbrio por stab y paz mental para tener mejor atq esp y def esp. No hay que decir nada mas, resiste bastante a exepcion de los ataques tipo hada ahi si tener mucho cuidado\r\n',NULL,'2015-11-26 02:08:59','2015-11-26 16:12:01',2,2,2,0,2,2,0,127,1),(177,'Kaze\'s Linoone VGC 15',264,116,252,4,NULL,116,20,135,11,82,245,421,187,182,'Evs en Hp para activar la Sitrus luego de usar Belly Drum\r\nLuego de Activar la Sitrus Berry:\r\n- Aguanta un Flash cannon de Aegislash (No Life Orb)\r\n- Probabilidades de aguantar Hyper Voice (Double Damage) de M-Gardevoir\r\n\r\nOutspedea a Bisharp, luego activar la Sitrus Berry, Knock off pega sin el bonus.\r\n- Mata landorus-T 4 hp estando -1 de atack (Una vez hecho Belly Drum y te tiren al Lando en un Switch)\r\n-Shadow Claw no solo ayuda contra fantasmas, sino prediciendo Quick Guards.\r\n-Shadow Claw a +6 garantiza el OHKO a un Aegislash 252 hp en Modo Escudo',NULL,'2015-11-26 16:51:00','2015-11-27 03:18:10',4,2,3,1,2,4,0,11,1),(178,'Quash, king',395,156,80,188,NULL,86,NULL,683,11,128,263,157,127,211,'',NULL,'2015-11-27 03:19:38','2016-02-29 03:55:49',3,-1,1,2,-1,3,0,128,1),(179,'Solarzard',6,108,NULL,60,164,4,172,717,3,94,182,315,76,257,'No hay mucha velocidad por parte de este charizard pero con un viento afin supera a m-manectric miedoso.Sofoco acaba con kangas, thundurus, lando y de 2 a cresselia. Rayo solar para cobertura y onda ignea para atacar a los dos objetivos en la partida.\r\nANOTACIONES:\r\n-Posibilidad de aguantar el retribucion de kangas firme 252 atq\r\n-Aguanta el rayo de thundurus bulky y life orb\r\n- Posibilidad de aguantar el rayo de m-manectric modesto 252 atq esp\r\n-Si no resiste el avalancha de garchomp y/o landorus standar se pueden modificar los evs de la siguiente manera: ps 172/def 92/atq esp 88/vel 156.\r\nEsta reparticion bajara la potencia y la velocidad, pero mejorara su bulk y lo hara resistente',NULL,'2015-11-27 04:09:47','2016-02-29 03:55:46',2,0,1,1,0,2,0,127,1),(180,'Trick Room Mega-Garchomp VGC 2016',445,204,252,NULL,52,NULL,NULL,722,21,24,89,157,434,182,'This is a simple set for using Mega-Garchomp in Trick Room.\r\n\r\nEV detail:\r\n+252 Atk ev for maximizing Garchomp attack power.\r\n52 SpA ev will OHKO Mega-Rayquaza with 4 HP ev.\r\nThe rest put into HP for more bulk.\r\n\r\nGood Teammates:\r\n- Cresselia (Levitate + Earthquake = fun)\r\n- Ferrothorn (kill Primal-Kyogre and Xerneas unless the latter bring Focus Blast)\r\n- Amoonguss (can redirect attack and slow Spore user in Trick Room = GG)\r\n- Crobat/Talonflame (fast Taunt user and the latter can still attack in Trick Room. Also, Quick-guard)\r\n\r\nWeakness:\r\n- Xerneas\r\n- Primal-Kyogre\r\n- Palkia (56.3% chance to OHKO 4 SpD ev Palkia with Draco Meteor)\r\n   Note: Use 140 SpA ev to OHKO Palkia with Draco Meteor\r\n\r\np.s. use 0 speed IV guys!',NULL,'2016-01-12 10:59:31','2016-02-29 03:55:42',4,0,2,2,0,4,0,130,2),(181,'Best Crobat',169,76,NULL,180,NULL,NULL,252,134,5,39,366,269,501,162,'La principal caracteristica es que aguanta casi siempre el DE de kanga jolly\r\n252 Atk Parental Bond Mega Kangaskhan Double-Edge vs. 76 HP / 180 Def Crobat: 146-173 (85.8 - 101.7%) -- 3.9% chance to OHKO\r\n\r\nLo ideal es usarlo con 0IV en ataque para minimizar el daño de Foul Play y Swagger\r\nSi el team se acomoda mas tambien es posible usarlo con Haze en lugar de Taunt',NULL,'2016-02-16 22:22:31','2016-02-29 03:55:39',1,1,1,0,1,1,0,5,1),(182,'Best Xerneas',716,22,NULL,28,204,4,252,248,5,187,585,605,601,182,'La gracia de este Xerneas es aguantar siempre el Dragon Ascent de LO Jolly M-Rayquaza\r\n252 Atk Life Orb Mega Rayquaza Dragon Ascent vs. 22 HP / 28 Def Xerneas: 172-203 (84.3 - 99.5%) -- guaranteed 2HKO\r\n\r\nEl resto es el tipico set de Xerneas, es necesario el max speed para asegurar como minimo el speed tie contra otros Xerneas',NULL,'2016-02-16 22:25:38','2016-04-07 05:12:45',2,0,1,1,0,2,0,5,1),(183,'Casi Standard Kanga VGC16',115,4,236,12,NULL,NULL,252,714,16,39,252,67,38,389,'Con este kanga tienes practicamente el mismo damage output:\r\nStandard Kanga:\r\n252 Atk Parental Bond Mega Kangaskhan Low Kick (100 BP) vs. 4 HP / 0 Def Mega Kangaskhan: 168-200 (92.8 - 110.4%) -- 59.8% chance to OHKO\r\nEste spread:\r\n236 Atk Parental Bond Mega Kangaskhan Low Kick (100 BP) vs. 4 HP / 0 Def Mega Kangaskhan: 168-200 (92.8 - 110.4%) -- 59.8% chance to OHKO\r\n\r\nPero defensivamente te permite reducir el porcentaje de OHKO de un Low Kick de Kanga oponente de un 59% a un 44%\r\n\r\n252 Atk Parental Bond Mega Kangaskhan Low Kick (100 BP) vs. 4 HP / 12 Def Mega Kangaskhan: 166-196 (91.7 - 108.2%) -- 44.1% chance to OHKO\r\n',NULL,'2016-02-16 22:33:44','2016-02-29 03:55:19',1,-1,0,1,-1,1,0,5,1),(184,'Landoge\'16 ',729,4,252,NULL,NULL,NULL,252,197,16,22,89,157,369,153,'',NULL,'2016-02-17 08:43:58','2016-04-07 05:12:17',2,0,1,1,0,2,0,20,1),(185,'Anti-Ray/Kyogre',483,252,NULL,NULL,252,4,NULL,168,3,140,434,406,430,433,'Los IVs son a elección personal: puedes usar uno Quiet 0 solo para TR o uno Modest 31 para TailRoom, sin embargo también puedes usarlo con Speed, de todas maneras se recomienda Modest/Quiet para mayor daño neutro a Kyogre. Shuca Berry te deja muy bien parado frente a P Groudon al cuál puedes debilitarlo con dos Dragon Pulse. ',NULL,'2016-02-17 08:50:19','2016-02-29 03:55:04',2,0,1,1,0,2,0,20,1),(186,'DatRaichu',26,4,252,NULL,NULL,NULL,252,277,16,31,252,364,344,182,'OHKO a Kyogre bulk, rompe Quick Guard, Crafty Shield, Protect y demases. Speed Tie con talonflame adamant 252 en speed. ',NULL,'2016-02-17 17:07:36','2016-04-07 05:13:19',2,0,1,1,0,2,0,111,1),(187,'Standard? Bronzong',437,252,236,20,NULL,NULL,NULL,134,22,26,433,360,356,285,'To be used with double primals in TR team\r\n-Can OHKO non-bulky Xerneas after Geomancy\r\n-Can survive -1 Fire Punch from Primal Groudon in the Sun\r\n-252 LO Dragon Ascent Mega Rayquaza is a 3HKO',NULL,'2016-04-07 05:09:42','2016-04-07 21:25:33',0,0,0,0,0,0,0,5,2),(188,'LO Mega Ray',384,4,252,NULL,NULL,NULL,252,247,16,76,620,245,434,182,'',NULL,'2016-04-26 03:42:15','2016-04-26 03:42:15',0,0,0,0,0,0,0,5,1),(189,'Sash Mega Ray',384,4,252,NULL,NULL,NULL,252,252,11,76,620,245,14,182,'+2 kill almost everything that is neutral resistant and above',NULL,'2016-04-26 03:44:20','2016-04-26 03:44:20',0,0,0,0,0,0,0,5,2),(190,'Gravity Kyurem-W',730,4,NULL,NULL,252,NULL,252,264,3,163,59,58,414,558,'Paired with Sableye or Meowstick to set gravity then spam blizzard',NULL,'2016-04-26 03:47:25','2016-04-26 04:24:18',0,0,0,0,0,0,0,5,2),(191,'Gravity Whimsicott',547,4,NULL,NULL,252,NULL,252,252,5,158,320,227,585,182,'To be used in gravity team, moonblast does good damage when in need',NULL,'2016-04-26 04:23:07','2016-04-26 04:23:07',0,0,0,0,0,0,0,5,2),(192,'Thundu \'16',642,4,NULL,NULL,252,NULL,252,252,5,158,85,86,269,182,'Can also be used with Sitrus Berry or Life Orb (and maybe Thunder instead of tbolt) according to team mates',NULL,'2016-04-26 04:32:55','2016-04-26 04:32:55',0,0,0,0,0,0,0,5,2),(193,'Fast Groudon',383,4,NULL,NULL,252,NULL,252,761,5,70,414,284,315,182,'This groudon is kill or be killed so it has to be played with good speed control',NULL,'2016-04-26 04:37:50','2016-04-26 04:37:50',0,0,0,0,0,0,0,5,2),(194,'TR Groudon',383,204,NULL,NULL,212,92,NULL,761,21,70,619,7,157,182,'Can survive 100% of times an Earth Power from 252 timid Groudon\r\nTo be used with 0iv speed, also can replace Rock Slide with Substitute or Sword Dance',NULL,'2016-04-26 04:41:38','2016-04-26 04:41:38',0,0,0,0,0,0,0,5,2),(195,'Semi bulk Kyogre',382,84,NULL,168,252,NULL,4,762,3,2,618,323,58,182,'EVed to survive LO Dragon Ascent from Jolly Mega Ray',NULL,'2016-04-26 04:44:15','2016-04-26 04:44:15',0,0,0,0,0,0,0,5,2);
